('8758b209626011ecbab300e04c680140', ' I enjoyed wathcing this video because it clearly shows the diffrences between approaches to teaching language.  The most important thing for me was getting to know that it is easier for students to understand something and see how it works when it is in context. What is more, I got to know that PPP is very popular and almost every coursebook is written in this way. I like that TTT approach stands for giving students exercises, monitoring them and then getting to know what do they already know, and then expanding their knowledge.It is focusing in the lesson on things that students really need. The lat one- TBL is flexible, learners have something to achive because it motivates the real need for a language. However it is difficult approach for teachers and coursebook writers. (AB)', 1916, 'esYQkx', 'olabondzio1999@op.pl', 1),
