('875ca693626011ecbab300e04c680140', 'A very nice summary of the two approaches. Have already learned that, but it was a good review. One thing that was thought-provoking was that not all structures work well for the inductive approach. Plus, I have to add that, from my personal experience, adults often do not enjoy being taught in this way. KU ', 431, 'gUegJA', 'AmbitiousTurkey', 1),
('875cc6ab626011ecbab300e04c680140', 'That was really interesting. I especially enjoyed hearing about possible disadvantages that each approach can have because it made me think more about my own choices for the type of learning I want to apply in my teaching. The part about PPP was nothing new to me, but the rest was quite informative and I think I learned a lot. However, I have to say that the video dragged on a little bit since 34 minutes is a lot to watch. It might have been better if the author skipped some parts (for example the part in which she introduces used to - I suppose the video is aimed at teachers, so she could have mentioned it briefly and that would be enough). ', 1920, 'esYQkx', 'AwfulUmbrette', 1),
