('876995d4626011ecbab300e04c680140', 'I\'m a fan the inductive approach. I especially like because it\'s engaging students into discovering the grammar rules by themselves. Thanks to such an approach students are not bored by the teacher\'s explanation. MP  ', 439, 'gUegJA', 'LiveLice', 1),
('8769b242626011ecbab300e04c680140', 'like', 0, 'esYQkx', 'PerkyMajungatholus', 1),
('8769ce58626011ecbab300e04c680140', 'I really enjoyed  this talk on diffrent approach to langauge teacching. They are were nicely and thoroughly presented. I believe that the choice of the appraoch depends on what works for the teacher and the students. It\'s a good idea to try and see for yourself with approach is best for you and you feel comfortable with. It\'s also important to observe whether the students feel comfortable with the approach and suits their learning style. MP', 0, 'esYQkx', 'PerkyMajungatholus', 1),
('8769ed15626011ecbab300e04c680140', 'like', 43, 'gUegJA', 'LividBassetHound', 1),
