('876a3f75626011ecbab300e04c680140', 'like', 303, 'gUegJA', 'LividBassetHound', 1),
('876a63eb626011ecbab300e04c680140', 'I really appreciate the video and I agree that Guided Discovery Approach is very beneficial for students. Once I introduced Past Simple in 5th grade in this way and it worked very well - students were provided with the text and they had to notice and underline all verbs. Then we worked out the rules together and did some practice. It was a nice lesson. PD', 0, 'gUegJA', 'EssentialIggyPops', 1),
('876a8593626011ecbab300e04c680140', 'like', 65, 'esYQkx', 'BaggyCusimanse', 1),
('876aa35f626011ecbab300e04c680140', 'like', 206, 'esYQkx', 'BaggyCusimanse', 1),
