('876ad8cd626011ecbab300e04c680140', 'like', 1324, 'esYQkx', 'BaggyCusimanse', 1),
('876af823626011ecbab300e04c680140', 'This approach to language teaching is the one that I use the most frequently, because I believe I that in this wau students are encouraged to participate in a lesson in an active way. PD', 656, 'esYQkx', 'BaggyCusimanse', 1),
('876b1477626011ecbab300e04c680140', 'I liked that the presenter talked about different teaching methods in an accessible and in-depth way. I definitely have more understanding now. E.S', 88, 'esYQkx', 'SparklingAmericanAlligator', 1),
('876b32ad626011ecbab300e04c680140', 'like', 309, 'gUegJA', 'IntentionalQueenslandGrouper', 1),
