('876b6722626011ecbab300e04c680140', 'The presenter talked about the guided discovery method in a condensed way but mentioned everything that is valid, and also gave a lot of helpful examples. E.S', 433, 'gUegJA', 'IntentionalQueenslandGrouper', 1),
('876b8527626011ecbab300e04c680140', 'Deductive approach - students discover the rules of grammar. It might be difficult to prepare and not all grammar rules are simple and straightforward. PP', 419, 'gUegJA', 'SelfishOzarkBigEaredBat', 1),
('876b9e79626011ecbab300e04c680140', 'PPP - Presentation (presenting the language, Practice(controlling the students and the output, Production(free practice). It\'s straightforward, logical, easy to follow but assumes linear view, it can be predictable and boring;\nTTT - Test, Teach, Test - first teacher monitors and listens to students, figures out the problem, then modeling, focus on lg - based on what sts said, then controlled practice followed by less controlled practice  TBL - Task Based Learning - Output followed by lg output, first task, e.g. try to persuade, teacher monitors and helps in preparing, then presentation/listening to models, teacher fills knowledge gaps, then freer practice PP', 2050, 'esYQkx', 'Quick-wittedDogwoodTwigBorer', 1),
('876bc577626011ecbab300e04c680140', 'When it comes to the disadvantages of the inductive approach, the fact that it\'s very time-consuming needs to be taken into consideration as well. The teacher ought to think whether it\'s worth it to spend a lot of time on an exercise where the students try to identify patterns; maybe it would be more beneficial to provide them with the theory and focus on actually practicing the structure. /KL', 443, 'gUegJA', 'FlawlessFox', 1),
('876c049a626011ecbab300e04c680140', 'like', 435, 'esYQkx', 'YellowAmoeba', 1),
('876c1f85626011ecbab300e04c680140', 'like', 1115, 'esYQkx', 'YellowAmoeba', 1),
('876c3d86626011ecbab300e04c680140', 'Agreed. During my teaching practice I would often find myself devoting more time to the controlled exercises, which are definitely easier to organise. I wouldn\'t necessarily say that PPP approach becomes boring though, because the communicative tasks are different each time. I think the students appreciate the logical structure of the lessons. /KL', 1115, 'esYQkx', 'YellowAmoeba', 1),
('876c5b0b626011ecbab300e04c680140', 'It can be motivating, but I wouldn\'t say it\'s more motivating than in PPP, for example. In both cases you can set a communicative goal, and the students will be happy to learn something useful. /KL', 1808, 'esYQkx', 'YellowAmoeba', 1),
