('87bd0341626011ecbab300e04c680140', 'Photography isn\'t necessarily about using a traditional camera, it can be about the recording of a physical space like Florian has produced with the lazers.', 184, 'xK5qGa', 'SingleAmazonParrot', 1),
('87bd1cf6626011ecbab300e04c680140', 'Photography takes time, effort and patience to produce. Florian creates a comparison between the cave and the darkroom.', 202, 'xK5qGa', 'SingleAmazonParrot', 1),
('87bd3670626011ecbab300e04c680140', 'Photography is an experience that is produced through a visual image, \"I can transport the experience I have when looking at pictures.\"', 234, 'xK5qGa', 'SingleAmazonParrot', 1),
('87bd555f626011ecbab300e04c680140', 'Traditional photography is restricted in the fact that photographs are presented onto a flat surface. Modern technology allows us to explore photographic images three-dimensionally. ', 68, 'xK5qGa', 'SingleAmazonParrot', 1),
('87bd71a6626011ecbab300e04c680140', 'No emotional attachment with sourced photographs which allows more creative freedom ', 29, 'GOUpp6', 'MealyHamster', 1),
('87bd8b61626011ecbab300e04c680140', 'Installation is all on the ground, in parts much like the car, to be viewed at from an above perspective- different from what you would expect at an exhibition and would be interesting to use this method of presentation in my own  ', 71, 'GOUpp6', 'MealyHamster', 1),
('87bda676626011ecbab300e04c680140', 'Explores his relationship with his father, his fathers relationship with the car through the installation', 96, 'GOUpp6', 'MealyHamster', 1),
('87bdc26b626011ecbab300e04c680140', 'Use the photographs that are around and tell that story, many stories left untold because the photographs aren\'t/won\'t be seen', 167, 'GOUpp6', 'MealyHamster', 1),
('87bdd995626011ecbab300e04c680140', 'Certain genres of photography are hard to define, can it be classed as photography?', 51, 'hcNvzd', 'GlossyJumpingBean', 1),
