('87be89f9626011ecbab300e04c680140', ' Christopher Williams is based in LA and Germany  - his exhibition at the White Chapel Gallery “The Production Line of Happiness” looks towards the continuous relevance of abstraction. Taking influence from Daniel Buren, he uses green wallpaper throughout the exhibition to help guide visitors through the space. I think that the level of thought and consideration of the surrounding elements of the gallery space really pays off and pulls the show together into a unique visual experience. The subjects of the exhibition are carefully curated and selected, showcasing both ordinary objects such as apples and more complex ones like photographic equipment. I think this consideration of composition works very well within the space. The images are minimalistic with a primary focus on the subject accompanied by colourful backgrounds, linking the green space segments back into the work. This is a very visually engaging exhibition and goes so far that I believe elements of emotion through the form ', 198, 'V9Zo0Z', 'LowOwl', 1),
('87bea4c0626011ecbab300e04c680140', 'Mixing photography other mediums, transorming an image to become sculptural  ', 38, 'gzLf55', 'CultivatedGermanShorthairedPointer', 1),
('87bec27a626011ecbab300e04c680140', 'Her work is representative of a personal point of view or perspective', 68, 'gzLf55', 'CultivatedGermanShorthairedPointer', 1),
('87bee1f1626011ecbab300e04c680140', 'Photography doesn\'t need to reflect reality, can be abstract ', 83, 'gzLf55', 'CultivatedGermanShorthairedPointer', 1),
('87bf0178626011ecbab300e04c680140', 'like', 308, 'jFA7rx', 'UnsteadyStarfish', 1),
('87bf1d04626011ecbab300e04c680140', 'Becky Beasly is a maker, a photographer and an artist. She works predominantly in the photographic medium, but with strong roots in the art industry after completing her education in art not photography, which she says gives her the freedom to play and explore.  Beasly questions the photographic practice with sculpture and her works are often a result of layering materials and outcomes to produce the final piece. For instance, she would work with photographs which might lead to her making a sculpture which in turn would lead to another photograph. She does not believe that the sculptures are her final outcomes, her photography is.  “I bring a kind of innocence to things” is a particularly interesting comment that she made as previously mentioned, she has a background in arts which she says influences her practice in a more playful manner.  She sees a benefit to not being an experienced and trained carpenter to make her pieces, and while she does work with a carpenter with over 20 years', 308, 'jFA7rx', 'UnsteadyStarfish', 1),
('87bf37ba626011ecbab300e04c680140', 'Classification and organisation of images has to be specific ', 77, 'hcNvzd', 'SecondaryCockatoo', 1),
('87bf56cd626011ecbab300e04c680140', 'classification via judgement and preconception based on the look of something/appearance of a person', 126, 'hcNvzd', 'SecondaryCockatoo', 1),
('87bf7100626011ecbab300e04c680140', 'Discussing what an image means is discussing a mechanism of power- meaning holds agency and power', 157, 'hcNvzd', 'SecondaryCockatoo', 1),
('87bf8823626011ecbab300e04c680140', 'Photography deals with the surface of things', 116, 'iclKM0', 'PreviousQuagga', 1),
('87bfa309626011ecbab300e04c680140', 'Use a surface as a means to explore something more or something which cannot be seen or directly captured in an image', 154, 'iclKM0', 'PreviousQuagga', 1),
('87bfbe3d626011ecbab300e04c680140', 'Photograph the absence- more of an atmosphere has been captured in his works where the absence can be understood and felt ', 195, 'iclKM0', 'PreviousQuagga', 1),
('87bfd7f3626011ecbab300e04c680140', 'like', 0, '8l3KDT', 'HarmlessEyas', 1),
('87bff93e626011ecbab300e04c680140', 'Viviane Sassen is an artist and photographer based in Amsterdam. Her works are informed by the Surrealist movement and work closely with this concept of abstractions. Additionally, she undertakes some fashion photography as well.  The way that Sassen describes her works are like that of a sentence. She sees each photograph as a word and when strung together in an exhibition setting, she creates a discourse which to her is like that of a poem or a sentence and if one image in the line up is removed or changed, the sentence takes on a whole new meaning.  Her process of using the surreal utilises the use of a familiar subject and through abstraction of irrelevant detail, she creates pieces of art within a photographic outcome. On a trip to Namibia she photographed the sand dunes of the Sossusvlei with the addition of mirrors and coloured perplex plates. This stems from the influence of Malevich’s Black Square image which she has been influenced by for a significant portion of her practice', 0, '8l3KDT', 'HarmlessEyas', 1),
('87c03864626011ecbab300e04c680140', 'like', 0, 'xK5qGa', 'InfamousJuliaButterfly', 1),
('87c054de626011ecbab300e04c680140', 'Florian Amoser’s attitudes to what photography is echoes a lot of the points made by Mishka Henner during his workshops. Amoser sees that a photograph exists as more than just a flat 2D image; it can offer an insight into a whole bigger scene/space/topic, acting as a mere fragment to stimulate your consideration and understanding into what has been captured. I think this is nicely summarised by Amoser describes his images as windows into the caves, they visually invite you into this new territory and challenge the conventions of a flat 2D image. Amoser described photography as a tool for exploration, rather than just the sole product that is ultimately desired. I think this really opens up the opportunity to develop work, if we can not necessarily focus solely on having some ‘perfect’ photographs as the final result with no thoughts as to how else our chosen subject could materialise into alternative visual and conceptual pieces of work. I see this links in with how Amoser notes his wo', 0, 'xK5qGa', 'InfamousJuliaButterfly', 1),
('87c0707e626011ecbab300e04c680140', 'like', 310, 'SUiuhi', 'LuminousDrake', 1),
('87c08d18626011ecbab300e04c680140', 'Steven Shore is a photographer working with colour film taking photographs of everything he sees that has some significance or looks interesting. He states that the nature of photography is ever evolving and that 50 years ago a photograph of a grilled cheese sandwich would not be interesting, and yet today its one of his most looked at works.  Shore looks to subjects that are fascinating and to him, food is fascinating – it’s a substance we consume 3 times a day. One obstacle he came across was finding a way to photograph a scene that resembled our natural vision, he didn’t want it to look staged or artificial. Over time, he found that he was dissatisfied with how small a print he was making so transitioned over to 8x10 colour film and through doing so, learnt an increadible amount in formality and composition. This was because the process is so expensive, so he would only take one photograph of a subject – taking time to prepare, find the best angle and one shot would be the final ima', 310, 'SUiuhi', 'LuminousDrake', 1),
('87c0a9b1626011ecbab300e04c680140', 'like', 274, 'xK5qGa', 'LuxuriousSalmon', 1),
('87c0c531626011ecbab300e04c680140', 'Florian Amoser is a photographer interested in spaces and the topic of the image, the contextual relevance behind it as opposed to the final outcome. He finds photography to be an important tool in understanding and analysing your surroundings so his methodology would begin with an observation and then the work comes from that initial point.  Amoser created a tool using a laser on two motors that could be programmed with specific movements. He would enter caves, shoot long exposures in complete darkness and the motors would draw the lines of the wire frames to map out the space and texture of the place.  He sees his work as both analogue and digital, in that his work feels like an analogue process, his ‘darkroom’ being a cave and the lines aren’t perfect, they’re wavy and not straight but at the same time there is a strong digital aesthetic to these lines in the images. He tried using normal landscapes, but it was too bright, hence the caves of Switzerland.  I think his work is incredi', 274, 'xK5qGa', 'LuxuriousSalmon', 1),
('87c0de2e626011ecbab300e04c680140', 'like', 197, 'hcNvzd', 'BothSeaUrchin', 1),
('87c0fae0626011ecbab300e04c680140', 'Kate Crawford and Trevor Paglen discuss the nature and processes to establishing datasets, and more crucially uncover the issues that arise from this. What a dataset does is take a collection of different images and break them down, so that they can easily be labelled and grouped together into distinct categories within the set. It seems like a practical way of organising data, but the decisions over what an image means and where it goes is a very powerful decision to make. Paglen reminds us that any image can have multiple complex meanings, so narrowing that down to one chosen meaning and place within the dataset could surely deter from the image’s power and narrative. And who gets to decide the range of categories. Paglen states that whoever is setting up the system for the dataset will undoubtably base it on their one particular way of seeing the world – we can’t help but be influenced by our own understanding, attitudes and experiences. I can understand that this would make dataset', 0, 'hcNvzd', 'BothSeaUrchin', 1),
('87c12d47626011ecbab300e04c680140', 'like', 211, 'V9Zo0Z', 'AdoredSeabird', 1),
('87c14ca5626011ecbab300e04c680140', 'like', 160, 'GOUpp6', 'FunctionalOtter', 1),
('87c167dc626011ecbab300e04c680140', 'Erik Kessels is an Art Director and graphic designer working with appropriated imagery.  He is interested in other’s work, especially amateur photography as he can pull together a series of works to provide context and add a story, a narrative, which is what makes them interesting. I personally cannot see myself not working with my own imagery, even if I use appropriated images in part, there has to be an element of manipulation or recreation, an addition to it for me to call it my work, my practice. I recognise that this is more of a case of curation, but I do not like this approach as much as the previous videos.  I like the way he ahs managed to make a personal connection with the subject this time around, with the semantics of his unfinished relationship with his father and the unfinished car, but I personally don’t see much more in the work beyond that and it doesn’t spark with me as much as the previous examples. ', 160, 'GOUpp6', 'FunctionalOtter', 1),
