('87c26f99626011ecbab300e04c680140', 'Giovanna Petrocchi works with photography to produce mixed media outcomes with a key component of abstraction. Her works revolve around ordinary and mundane objects, but they’re personal to her.  I like the fact that she uses this mixed media approach, as she tries to elevate her photography to a different level and point. She wants to turn the ordinary into something that is very interesting – she wants to share her point of view with the audience.  Her practice with abstraction is  an interesting way to interpret and push the boundaries of photography and it is something that I find myself doing in my own practice. It doesn’t have to be a straight forward photograph to be photographic and I think it relates to the question of what photography is very well.  I like the strange sculptures that she incorporates within her installation, and especially the careful curation of how everything sits together, the final display in an exhibition setting. I think it would have been useful to hea', 96, 'gzLf55', 'AfraidIbex', 1),
