('87c52440626011ecbab300e04c680140', 'Kate Crawford & Trevor Paglen on interpreting databases talk a lot about the categorisation of people. Our world is infinitely complex as they say, and by categorising and classifying things and people can be reductive, and not taking everything into account.  I think the important takeaway from this is that you have to decide what the categories themselves are, what the range of a thing is. It is important to keep in mind that there is many different extraneous variables – and there is a fine line between description and judgment. This relationship between an image and a label and there is always a political element to this, because you’re having to keep all of this in mind. You cannot simply see one outcome to an image, as there is so much complexity to an image, that you need to critically evaluate how a thing might work and how it may fail.  I think that this is something we need to keep in mind with this exhibit in the city module, as we have gone along the route of memory and mem', 0, 'hcNvzd', 'RobustIbex', 1),
