('87cf4857626011ecbab300e04c680140', 'To me, this video (which i have watched plenty of times, doesn\'t seem to answer what photography is. it does state that part of categorising in image is based mostly on judgment and people\'s personal views, which i do agree on. People will view things differently if theyre looking into it as a certain categorisation, but without any  category, its open to peoples views and the image is open to so much more meaing.', 39, 'hcNvzd', 'FlatPartridge', 1),
