('87d05877626011ecbab300e04c680140', 'Photography considers more than just an outcome. Within art a lot of focus is put onto the outcome of a piece of work I feel, even from the conception of an idea, but in photography you can start from just a desire to observe/analyse without having thought of an idea first.', 258, 'xK5qGa', 'PerfumedPolecat', 1),
('87d07cb1626011ecbab300e04c680140', 'He talks about the way his work leaves an element to the imagination of the viewer. We know photography is often viewed as the most \'truthful\' art form in the way it can capture life, but he encourages the concept that in fact we all read images how we read words, with individual and personal interpretations.', 259, 'xK5qGa', 'PerfumedPolecat', 1),
('87d097a3626011ecbab300e04c680140', 'We already consider photography as a process to be very light dependent in our understanding of how film works and how this thinking as been transferred into digital technologies, but he also refers to his work as being light dependent in a very different manner. In order to make his work he needs complete darkness, this idea got me thinking about how photography is very much light influenced, no matter how you approach it, be it traditionally or conceptually, it\'s always thinking/considering the impact of light on an image. ', 260, 'xK5qGa', 'PerfumedPolecat', 1),
('87d0b8bf626011ecbab300e04c680140', 'I feel like people nearly always consider photography and the process of making photographs as a very visual thing, but he talks about the way when you\'re submerged in complete darkness (be it in a darkroom or in a cave), sounds and other senses very much dictate the space you\'re working within and therefore play into the final outcome itself in many ways.', 261, 'xK5qGa', 'PerfumedPolecat', 1),
('87d0d882626011ecbab300e04c680140', 'I feel like on a basic level, many may interpret photography with 3 factors when it comes to image making; the subject/landscape being captured, the camera and the person behind the lens. In making images there has always been discussion as to how much is the photographer creating the work and how big a role the camera plays into this making, the way in which he refers to immersing himself into the landscape in which he\'s capturing adds another element to the process of actually capturing images.', 262, 'xK5qGa', 'PerfumedPolecat', 1),
('87d13c5a626011ecbab300e04c680140', 'Although photography is often seen as \'truth\', the meaning of an image actually comes down to the personal view/ \'judgement\' of the viewer', 133, 'hcNvzd', 'HalfFox', 1),
('87d16b2b626011ecbab300e04c680140', 'This potential conflict in the reading of an image can catapult a photograph into spheres outside of the \'art world\' , in this case they refer to politics.', 145, 'hcNvzd', 'HalfFox', 1),
