('87f0953f626011ecbab300e04c680140', '1.Le vie aeree sono divise in superiori: cavità nasale, faringe, laringe e trachea e vie aeree inferiori : bronchi e polmoni.   NUZZO ', 163, 'kAN7YT', 'NiceAcornWoodpecker', 1),
('87f0af99626011ecbab300e04c680140', '2.L\'organo della laringe serve alla emissione dei suoni (fonazione) e permette di inspirare aria da naso e bocca verso i polmoni e viceversa, di espirare. NUZZO', 164, 'kAN7YT', 'NiceAcornWoodpecker', 1),
('87f0ce07626011ecbab300e04c680140', '3.La trachea, un tubo lungo 10 cm circa, si divide in due condotti, cioè i bronchi ognuno dei quali porta l\'aria ai polmoni. NUZZO', 166, 'kAN7YT', 'NiceAcornWoodpecker', 1),
('87f0f183626011ecbab300e04c680140', '4.I polmoni sono costituiti da una membrana a doppio strato chiamata pleura ,hanno una struttura spugnosa perché sono costituiti da minuscoli sacchi chiamati alveoli polmonari. NUZZO', 167, 'kAN7YT', 'NiceAcornWoodpecker', 1),
('87f10fe7626011ecbab300e04c680140', '5.Negli alveoli polmonari avviene lo scambio gassoso tra ossigeno e diossido di carbonio. NUZZO', 169, 'kAN7YT', 'NiceAcornWoodpecker', 1),
('87f1306e626011ecbab300e04c680140', '1. Le vie aeree sono: il naso, la bocca, la faringe, la laringe, la trachea, i bronchi e i bronchioli.  Ciampa Gerardo', 0, 'kAN7YT', 'TartFowl', 1),
('87f14955626011ecbab300e04c680140', '2. L\'organo della laringe serve a consentire l\'emissione dei suoni grazie alle corde vocali che vibrano al passaggio dell\'aria espirata; e permette il passaggio  dell\'aria inspirata, ovvero dal naso ai polmoni, ed espirata, cioè dai polmoni verso naso e bocca. Ciampa Gerardo  ', 2, 'kAN7YT', 'TartFowl', 1),
('87f1690c626011ecbab300e04c680140', ' 3. La trachea si divide in due condotti chiamati bronchi, ognuno porta l\'aria al polmone corrispondente, destro e sinistro; ciascun bronco si ramifica in condotti più piccoli detti bronchioli  che infine terminano negli alveoli polmonari.  Ciampa Gerado  ', 4, 'kAN7YT', 'TartFowl', 1),
('87f185d5626011ecbab300e04c680140', ' 4. I polmoni sono costituiti da lobuli, strutture formate da bronchioli che terminano con gli alveoli polmonari ricoperti di capillari. Ciampa Gerardo  ', 6, 'kAN7YT', 'TartFowl', 1),
('87f1a5f3626011ecbab300e04c680140', '5. Negli alveoli polmonari avvengono gli scambi di ossigeno e anidride carbonica, questo scambio è importantissimo perché permette all\'ossigeno di entrare nei capillari per poi passare nelle arterie e nelle vene in modo che circoli sangue in tutto il nostro corpo. Ciampa Gerardo ', 174, 'kAN7YT', 'TartFowl', 1),
('87f1bfd4626011ecbab300e04c680140', '3) La trachea di divide in due bronchi che allora volta si dividono in bronchioli e alveoli polmonari. Gianni Luca Di Ruocco', 0, 'kAN7YT', 'ForthrightGraywolf', 1),
('87f1e327626011ecbab300e04c680140', '4) I polmoni sono costituiti da un tessuto spugnoso ed elastico. I due polmoni sono separati dal mediastino ed uniti dalla trachea. Gianni Luca Di Ruocco', 0, 'kAN7YT', 'ForthrightGraywolf', 1),
('87f1feee626011ecbab300e04c680140', '5) Gli alveoli polmonari hanno  una funzione importantissima: lo scambio di gas respiratori tra il sangue e l\'atmosfera. La funzione primaria degli alveoli è arricchire il sangue di ossigeno e ripulirlo dall\'anidride carbonica. Gianni Luca Di Ruocco', 0, 'kAN7YT', 'ForthrightGraywolf', 1),
('87f2192d626011ecbab300e04c680140', '1) Naso e bocca poi faringe-laringe-trachea-2bronchi-polmoni Gianni Luca Di Ruocco', 1, 'kAN7YT', 'ForthrightGraywolf', 1),
('87f23151626011ecbab300e04c680140', '2) La laringe comunica con la faringe e continua nella trachea. Permette il passaggio dell’aria respirata e poi trasforma l’aria respirata in suono.    Gianni Luca Di Ruocco', 1, 'kAN7YT', 'ForthrightGraywolf', 1),
('87f24e63626011ecbab300e04c680140', '1) naso, bocca, faringe, laringe, trachea, bronchi, bronchioli e alveoli polmonari BRIGLIA', 0, 'kAN7YT', 'LumberingFrog', 1),
('87f271f1626011ecbab300e04c680140', '2) permette il passaggio di aria espirata e aspirata e, inoltre, all\'interno di essa si trovano le corde vocali BRIGLIA', 212, 'kAN7YT', 'LumberingFrog', 1),
('87f28bd0626011ecbab300e04c680140', '3) la trache si divide in bronchi che a loro volta si dividono in bronchioli che terminano con gli alveoli polmonari BRIGLIA', 216, 'kAN7YT', 'LumberingFrog', 1),
('87f2a60e626011ecbab300e04c680140', '4) i polmoni sono costituiti da lobi: il polmone destro è formato da 3 lobi mentre il sinistro da 2 (per fare spazio al cuore) BRIGLIA', 217, 'kAN7YT', 'LumberingFrog', 1),
('87f2c60a626011ecbab300e04c680140', 'Negli alveoli polmonari avviene, per diffusione, lo scambio di ossigeno (O2) e anidride carbonica (CO2) col sangue BRIGLIA', 218, 'kAN7YT', 'LumberingFrog', 1),
