('87f847d4626011ecbab300e04c680140', '1. Le vie aeree sono: il naso, la bocca, la faringe, la laringe, la trachea, i bronchi e i bronchioli.  2. L\'organo della laringe serve per produrre l\'emissione dei suoni grazie alle corde vocali che vibrano al passaggio dell\'aria espirata inoltre permette il passaggio  dell\'aria inspirata( dal naso ai polmoni)ed espirata (dai polmoni verso naso e bocca).  3. La trachea si divide in due condotti chiamati bronchi, ognuno porta l\'aria al polmone corrispondente, destro e sinistro, ciascun bronco si ramifica in condotti più piccoli detti bronchioli  che terminano negli alveoli polmonari.  4. I polmoni sono costituiti da lobuli che sono strutture formate da bronchioli che terminano con gli alveoli polmonari ricoperti di capillari.  5. Negli alveoli polmonari avvengono gli scambi di ossigeno e anidride carbonica, questo scambio permette all\'ossigeno di entrare nei capillari per poi passare nelle arterie e nelle vene in modo che circoli sangue in tutto il nostro corpo. DE GENNARO MANUEL', 0, 'kAN7YT', 'ScentedVerdin', 1),
