('8800fb27626011ecbab300e04c680140', '1naso(se otturato bocca),per continuare con la faringe,laringe,trachea che si divide in 2 ramificazioni(bronchi)che vanno una nel polmone destro e una in quello sinistro, infine i polmoni con bronchioli e alveoli.Esposito Francesco 2F', 106, '2H6rDB', 'ParallelHog', 1),
('88011b3c626011ecbab300e04c680140', '3 2 ramificazioni(bronchi) che vanno una nel polmone destro e una in quello sinistro,a loro volta i bronchi si dividono ulteriormente in bronchioli e infine in alveoli polmonari.La trachea è un tubo lungo circa 10cm che poi si va a dividere come già detto.Esposito Francesco 2F', 108, '2H6rDB', 'ParallelHog', 1),
('88013a7d626011ecbab300e04c680140', '4) milioni di alveoli polmonari, come si può vedere nel video a 2 minuti e 30 secondi nella slide a sinistra possiamo vedere che avvengono scambi di ossigeno ed anidride carbonica,importantissimo,perché questo scambio fa sì che l’ossigeno entri nei capillari e dai capillari poi alle arteree alle vene e va in tutto il nostro corpo. Esposito Francesco 2F', 150, '2H6rDB', 'ParallelHog', 1),
('88015df2626011ecbab300e04c680140', '5)avvengono gli scambi gassosi, e gli alveoli polmonari sono minuscoli “palloncini” di tessuto epiteliale. Esposito Francesco 2F', 271, '2H6rDB', 'ParallelHog', 1),
('88017640626011ecbab300e04c680140', '1)cavita nasali, faringe, laringe, trachea,bronchi, bronchioli    2) serve a produrre un suono      3) la trachea si divide in bronchi        4)i polmoni sono costituiti da bronchioli e alveoli polmonari     5) negli alveoli polmonari avvengono gli scambi gassosi     PIZZA', 0, '2H6rDB', 'EnergeticCicada', 1),
