('8801f7a7626011ecbab300e04c680140', '1- Le vie aeree sono: Naso,bocca,faringe,laringe e per continuare trachea,bronchi e polmoni.2-Nella laringe passa l\'aria e vi sono le corde vocali che vibrano al passare dell\'aria per l\'emissioni dei suoni.3-La trachea si divide in 2 condotti, i bronchi,ognuno dei quali porta l\'aria al polmone corrispondente destro e sinistro.4-I polmoni hanno una struttura spugnosa perchè sono costituiti da milioni di alveoli che sono avvolti da una fitta rete di capillari.5-Negli alveoli polmonari avvengono gli scambi gassosi tra l\'aria e il sangue grazie al processo di diffusione:l\'ossigeno diffonde dagli alveoli dove è piu concentrato al sangue dove è meno concentrato; al contrario il diossido di carbonio diffonde dai capi ', 0, '2H6rDB', 'TerrificXantusMurrelet', 1),
('880219a8626011ecbab300e04c680140', '1-Le vie aeree sono:naso,bocca,faringe,laringe e continuano con trachea, bronchi e polmoni.2-Nella laringe passa l\'aria e si trovano le corde vocali, che vibrano al passaggio dell\'aria e ci permettono di emettere suoni.3-La trachea si divide in due condotti, i bronchi,ognuno dei quali porta l\'aria al polmone corrispondente,destro e sinistro.4-I polmoni hanno una struttura spugnosa perchè sono costituiti da grappoli di minuscoli palloncini chiamati alveoli polmonari che sono avvolti da una fitta rete di capillari.Ogni uomo ha circa 300 milioni di alveoli.5-Negli alveoli avvengono gli scambi gassosi grazie al processo di diffusione: l\'ossigeno diffonde dall\'aria alveolare dove è più concentrato al sangue dei capillari dove è meno concentrato; al contrario il diossido di carbonio diffonde dal sangue dei capillari,dove è piu concentrato,all\'aria degli alveoli dove è meno concentrato. IACCARINO COSTANTINO 2F.', 2, '2H6rDB', 'TerrificXantusMurrelet', 1),
