('880e162c626011ecbab300e04c680140', 'this related back to the brief and the question of: what is photography? he sees photography as being a documentation of time. a single frame representing a second in time.  ', 17, 'NCxput', 'ThankfulAstrangiaCoral', 1),
('880e3714626011ecbab300e04c680140', 'He sees a camera as being the toll for photography and for capturing this moment in time. often the camera does see how we do and this leads to limitations. He hints at this idea of pushing these limitations and pushing the ideas of what photography really is. ', 26, 'NCxput', 'ThankfulAstrangiaCoral', 1),
('880e534e626011ecbab300e04c680140', 'As photographers we set expectations for ourselves and see ourselves fail when in reality is there a right and wrong within photography. photography is a broad subject open for interoperation ', 65, 'NCxput', 'ThankfulAstrangiaCoral', 1),
('880e6dc6626011ecbab300e04c680140', 'His projects develop form a passion, helping to give the work legs and helping to push the work further. Having a reasoning for your work  helps in the creation, this passion is shown through the images.', 140, 'NCxput', 'ThankfulAstrangiaCoral', 1),
('880e8987626011ecbab300e04c680140', 'its interring how he talks about this shift in the creation of his work. As a photographer i create work because i want to and am interested in it. This comment made me think about how you would think differently if you are constantly thinking about creating the work for an audience and they way in which you might photograph differently.', 213, 'NCxput', 'ThankfulAstrangiaCoral', 1),
('880ea249626011ecbab300e04c680140', 'I like this idea of photography being a tool and having the power to change you perception on something. photography is a more powerful form than literature it has the ability to make you question things and change your hole perception of life in one image. ', 246, 'NCxput', 'ThankfulAstrangiaCoral', 1),
('880ebe76626011ecbab300e04c680140', 'This idea surrounding the experience and the photograph is a good thing to think about. If photography is a tool for capturing this moment in time, in essence you are capturing the experience. This links back to this hole idea of time and memory and photography being used as a tool in the help of remembering these experience and looking back at the images to spark emotion, however this emotion is different for viewers who have not had this same experience. ', 290, 'NCxput', 'ThankfulAstrangiaCoral', 1),
