('880f1a65626011ecbab300e04c680140', '*DOMANDE BIOLOGIA CASABONA ANTONIO 2F*  1-Le vie aeree sono composte da :  -naso -bocca -faringe -laringe  -nasofaringe  -trachea  -bronchi -bronchioli   2-La laringe è l\'organo deputato alla fonazione, ovvero all\'emissione dei suoni. È situata nel collo, tra la faringe e la trachea, e si presenta come un cilindro cavo. La laringe permette anche il passaggio dell\'aria inspirata (da naso e bocca verso i bronchi) ed espirata (dai bronchi verso naso e bocca).   3- La trachea è un organo dell’apparato respiratorio, la cui funzione primaria è trasferire l’aria dall’esterno ai polmoni, ripulendola e umidificandola. Morfologicamente è un condotto impari e mediano; fa parte delle vie aeree inferiori insieme alla laringe che la precede e ai bronchi che la seguono. È un viscere cavo tubulare che  si divide nei due bronchi principali (destro e sinistro) in un punto denominato carena, sfocianti nei rispettivi polmoni.   4- I polmoni sono avvolti da una membrana sierosa, la pleura, a sua volta form', 141, '2H6rDB', 'EnviousNorwayRat', 1),
