('8811a83d626011ecbab300e04c680140', 'They saw the camera as being another form of art, a way to capture the unconscious. referring to is as a model for vision suggest to the camera being a recording device almost capturing the future.  ', 43, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('8811c306626011ecbab300e04c680140', 'I find the remark around the camera illustrates forgetting creating this idea that photography is a form of memory and the link of how a photograph can spark a memory. And how without photographs there is no way to reminisce.  ', 63, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('8811dc9e626011ecbab300e04c680140', 'I find this part to be slightly confusing. I find the idea of an image being taken in a state of unconsciousness to be unfamiliar and the idea that the process of the creation of this image and the development of the positive brings to light the image. Almost representing a metaphor for life.    ', 82, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('8811fbb8626011ecbab300e04c680140', 'He links photography with the ideas of memory and the tool that photography can be used in capturing these memory\'s.', 102, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('88121aac626011ecbab300e04c680140', 'I like this idea that each photograph sparks a different memory. ', 110, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('8812437f626011ecbab300e04c680140', 'he thinks more about this coronation between the image and the viewer and how different images can spark different emotions/memories for different people.  ', 118, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('88126a4c626011ecbab300e04c680140', 'studium: The studium indicates historical, social or cultural meanings extracted via semiotic analysis. Punctum: The punctum points to those features of a photograph that seem to produce or convey a meaning without invoking any recognisable symbolic system.', 145, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('88128a09626011ecbab300e04c680140', 'I think this relates to the idea that when viewing an image it sarks an unconscious reaction which is only brought to light when thinking about studium and punctum and when these are present within an image. ', 177, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('8812a737626011ecbab300e04c680140', 'Photography acts as i sight into our uncurious minds. suggesting at the idea that photography is a form on identity, a way to express yourself through the unconscious. ', 206, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
('8812c75f626011ecbab300e04c680140', 'This creates that idea that a photograph is a form of the unconscious and when this is held and touched the image hold more emotional weight. This makes me think about the way in which we display photography and how this varys between digital and analogue. How being able to touch and hold photograph produced on film sparks more emotion that an image displayed on a screen. Being able to touch and hold the unconscious makes it the conscious.   ', 242, 'fXX6Kv', 'LonelyTasmanianTiger', 1),
