('883759a8626011ecbab300e04c680140', 'Video muito elucidativo acerca da análise CVR. Focagem dos pontos importantes, gráfico bem elaborado que permite a consolidação da análise CVR. O video é uma importante ferramenta de estudo para o aluno, uma vez que permite a sua visualização a qualquer momento, podendo em caso de duvidas ver as vezes que forem necessárias. Funciona quase como uma aula individualizada. A ferramenta EVOLI, no meu ponto de vista, é uma mais valia quer para o aluno quer para o professor, na medida em que permite ao aluno no decorrer do video, transmitir se percebeu os conteúdos ou não,  possibilitando ao professor constatar quais as suas dificuldades na compreensão dos diversos conteúdos.', 163, '8O1gMa', 'DeadlyBarebirdbat', 1),
