('883a11a1626011ecbab300e04c680140', 'Esquematização simples do exercicio e fácil de perceber. A resolução do exercicio em video permite ao aluno acompanhar passo a passo cada ponto da resolução, ouvir a explicação de cada detalhe, o que torna este método uma excelente ferramenta de estudo. A ferramenta EVOLI, é um complemento muito importante porque permite transmitir ao professor atraves dos comandos \"percebi\" e \"não percebi\" os pontos de dificuldade de cada aluno, podendo assim o professor perceber quais  as dificuldades para dessa forma poder ajudar os alunos esclarecendo as suas dúvidas. Outro aspeto positivo desta ferramenta é que permite aquele aluno mais tímido e que tem vergonha ou receio de expor as suas duvidas na sala de aula, fazê-lo desta forma, pois assim está mais à vontade uma vez que não está perante os colegas de turma. ', 332, 'KW12R6', 'FirstLovebird', 1),
