('88487396626011ecbab300e04c680140', 'Photography doesn\'t have to be something that is learnt through an education system, if there is a passion for it then anything can be done/created.', 0, '3nkO5m', 'MutedBrahmanBull', 1),
('88489964626011ecbab300e04c680140', 'I don\'t have to like every image that I take and I can leave an image without instantly working on it. This may be more beneficial to my creative process and outcome.', 0, '3nkO5m', 'MutedBrahmanBull', 1),
('8848c29f626011ecbab300e04c680140', 'I should be making work on everything that interests and fascinates me so that I can create work thats I can put all my energy and effort into so I can create the best outcome.', 1, '3nkO5m', 'MutedBrahmanBull', 1),
('8848e2b1626011ecbab300e04c680140', 'I should have more trust in myself on shoots and shoot more so that I can see an improvement and feel more comfortable at said shoots. ', 4, '3nkO5m', 'MutedBrahmanBull', 1),
('88490765626011ecbab300e04c680140', 'To not always be the dictator of a shoot and know when this is appropriate. ', 5, '3nkO5m', 'MutedBrahmanBull', 1),
('884933d7626011ecbab300e04c680140', 'Photography is powerful in giving me an insight into someone elses experiences and how we can portray this.', 43, '3nkO5m', 'MutedBrahmanBull', 1),
('88495223626011ecbab300e04c680140', 'Photography is something that I can do no matter what my life path is, it is something that I can do on the side or it is something that I can do full time.', 87, 'SfScSn', 'GenuineHamadryad', 1),
('884970b9626011ecbab300e04c680140', 'Photography is a medium that allows people to feel without using words, the images speak for themselves and I have control over what is portrayed.', 90, 'SfScSn', 'GenuineHamadryad', 1),
('8849935e626011ecbab300e04c680140', 'Photographs can make people feel different emotions and feeling, I want to make my viewers feel tranquil and connected. Inspiration can come from anywhere but understanding of things can make my work more influential.', 123, 'SfScSn', 'GenuineHamadryad', 1),
('8849b356626011ecbab300e04c680140', 'A good photographer will make something out of nothing. Always stop my side projects that I like to shoot and find fun when I have paid work.', 280, 'SfScSn', 'GenuineHamadryad', 1),
('8849ebaa626011ecbab300e04c680140', 'There is uncertainty shooting in film but this can make the shoot exciting not knowing how the images will turn out.', 332, 'SfScSn', 'GenuineHamadryad', 1),
('884a1a16626011ecbab300e04c680140', 'Work where I am to my advantage, use the materials that I am surrounded by. Make work all the time, go out and shoot. Work out how to frame things and showcase them.', 343, 'SfScSn', 'GenuineHamadryad', 1),
