('884cdd0f626011ecbab300e04c680140', 'like', 0, 'VDXvTH', 'VirtualInsect', 1),
('884d03be626011ecbab300e04c680140', 'Dorothea Tanning was a Surrealist painter later turned sculptor. There are reoccurring motifs present throughout her works including doors, sunflowers and little girls. Tanning tried capturing the fragility of life and love through her art. Her work is how she made sense of the world around her.  I think it’s interesting to see how Tanning utilised her skills and knowledge of the world around her to paint and sculpt these bizarre scenarios. I am currently exploring the world of surrealism within my works, and while this isn’t necessarily photographic, I believe it is of use to me within my project as it gives me a deeper contextual understanding of what the art movement stands behind.  Tanning’s work is deeply embedded into the dream world, the traditional approach of the surrealists to explore the unconscious mind. Within my own work, I am starting to embrace this notion of exploring the dream world – of manipulating images to be something recognisable but not quite, so your eyes wand', 0, 'VDXvTH', 'VirtualInsect', 1),
('884d2222626011ecbab300e04c680140', 'like', 0, 'fd605E', 'EqualRaven', 1),
('884d414d626011ecbab300e04c680140', 'Lee Miller was a Surrealist, Fashion & Commercial Photographer and later War Correspondant. Her varied background drove her artistic development which has been a point of fascination surrounding her within the art industry. She moved from New York to Paris to learn photography from Man Ray, and from there her surrealist work began.  The central themes of surrealism include the unconscious, the non-visible and the phantasmagorical however portraying that through photography is challenging as photography captures the apparent reality around us with the press of a shutter. To combat this, Miller and Ray developed techniques including solarisation and narrow image sections in her work to put across this sense of the surreal.  Another element of surrealism lies in sex and as such female nude portraits were often depicted in the movement, however Miller’s nude photographs take on a feminist aura due to her positioning and careful curation on the zoom and cropping of the frame. Where normally', 0, 'fd605E', 'EqualRaven', 1),
