('884ea276626011ecbab300e04c680140', 'I understand the new adjusted brief, I am just having trouble with the accompanying exhibition supportive material. Obviously being stuck at home has hindered my creative drive and whilst I can still zoom with my group this is only for a fragment of the week. I struggle with the rest of the time of what I can do as being at home there is only so much that is possible. I know this is just a hurdle I need to overcome and it will take time. It is just a struggle of mine at the moment that im sure alot of people are also in. ', 205, 'OmyaCV', 'ElectricNightjar', 1),
