('884f3186626011ecbab300e04c680140', 'Interested in materiality of photographic print, not photography as a means of documentation...looking into the photograph as an object in its own right. How can we explore and discuss this now living in a digital age, whereby the majority of the imagery we see is viewed digitally/ through a screen.. how does this alter our perception/ interpretation of the image', 59, 'yNPX7P', 'MustyMoth', 1),
