('88504b5c626011ecbab300e04c680140', 'She uses these \'pure\' black, white and red colours in her series \"Femme Maison\". When she says she changed from this palette in 1993 because \"life is not a matter of black and white” this suggests that to her when she was painting “Femme Maison” is was a black and white situation- she believed it to be a simple matter that was true.', 157, 'vnJ6Ym', 'FluffyHyrax', 1),
('885068e4626011ecbab300e04c680140', 'She works to a rhythm, I find the rhythm matches her heart beat. When she says she has a coffee, the metronome speeds up, and when she is tired it slows down. Some of her work focuses on the psychological matters and involves, organs and limbs. I think she physically connects to a lot of her work. This can be seen in Femme Maison where she draws the female figure stark and vulnerable. ', 380, 'vnJ6Ym', 'FluffyHyrax', 1),
('88508821626011ecbab300e04c680140', 'Her art is a reflection of the self but also in the case of Femme Maison, a reflection of many other women. When at home they believe they are safe but at the very moment they are trying to be hidden from view, they are revealed.  ', 742, 'vnJ6Ym', 'FluffyHyrax', 1),
