('88514754626011ecbab300e04c680140', 'Jaya Pelupessy’s practice centres around the notion of reproduction within the world of photography.  Pelupessy describes the act of taking a picture as a ‘fictionalisation’ of a subject. Whatever you’ve taken a picture of has been captured and frozen as a fictional document – a now separate realm to the reality, the original state and place within the world. Thus, there is a lot more to a picture than just the final picture itself. A whole flow of planning, processes, construction has occurred in order to achieve the end result we see as an image; various pieces of equipment, technology, locations. Pelupessy believes that due to seeing such a mass amount of imagery being reproduced day-in day-out within today’s society, we fail to properly consider the work that has gone into making each image. A photo obviously doesn’t come out of nowhere, and Pelupessy works with exploring the significance of what happens BTS. Pelupessy connects the photographical process with the final fictionalisa', 0, 'qMWqjr', 'AdoredJay', 1),
('88516c97626011ecbab300e04c680140', 'Loneliness during isolation is a problem for many, especially those who may be currently separated from a partner. The way Saviour is slumped around the house with nothing to do portrays the boredom most people are facing at the moment. The empty feeling people have at the moment and she has in this song are portrayed by the positioning of her body; with her limbs flailed about and her eyes looking around. This gives the idea that the lights are on but nobodys home, we are merely existing during this time but not living.', 0, '7we1Mj', 'EvergreenAss', 1),
('88519eea626011ecbab300e04c680140', 'The bright colours of green and red used throughout the video enable her body to stand out more. I think during this time it would be beneficial to try a shoot where the body blends into the background more. As we are stuck at home for a long period of time without leaving we almost become part of the furniture. ', 56, '7we1Mj', 'EvergreenAss', 1),
('8851c926626011ecbab300e04c680140', 'Throughout the video, Saviour is seen to be laying around various parts of a house. Whilst the song is about her thinking about a boy that she is not with, the idea of waiting and longing is prevelant and something most people are currently facing whilst sitting in isolation at the moment. ', 120, '7we1Mj', 'EvergreenAss', 1),
