('88bf048b626011ecbab300e04c680140', 'O meu nome é Joana Azevedo ( 2150486) e frequento a disciplina Comunicação Digital no âmbito do mestrado em Assessoria e Comunicação Digital no ISCAP. Este vídeo foi bastante enriquecedor na medida em que uma das tarefas pedidas no contexto da UC é o desenvolvimento de um web site. O trabalho é de realização em grupo, no meu caso os meus colegas de grupo já têm bastantes luzes de edição web e de web design, com este vídeo consegui adquirir ferramentas que me facilitaram alguns processos para acompanhar o trabalho. Venho por este meio expressar o quão útil e prático me foi assistir ao mesmo. Muito Obrigado.  ', 5281, 'dFrfZw', 'VoluminousGrasshopper', 1),
