('88c25f26626011ecbab300e04c680140', 'I really enjoyed this video because I got to know that the main problem with listening exercises during English classes may be connected speech. The main reason of that is that in English there occur weak forms so for example: a, have, at, are can be pronounced as a one sound. Students do not hear what they expect to and it causes problems with understanding. To solve that problem teacher can do some exercises with word boundaries, one can read a sentence with weak forms and ask students to guess how many words does this sentence contain. Students can also do this exercise in pairs. They may find it interesting. But the key point is to practise such skills little and often, so they will not get bored. - AB, RAF2 ', 535, 'E6zJn2', 'SqueakyQuelea', 1),
('88c27ed5626011ecbab300e04c680140', 'like', 395, 'frkjPi', 'HelplessLightningBug', 1),
('88c29dd7626011ecbab300e04c680140', 'In this video I got to know that reading can be much easier for students than listening to the text, because when it comes to reading, students have a text which is kind of perminent and they always can go back and read again the part that they did not understand. And when it comes to listening, such part of the text was said and it probably will not appear anymore. What is more, in English there are many connected speech issues such as weak , which cause many problems during listetning for learners. The author of the video says about top-down processing. It is connected with content schemata, so it is all about giving the context during learning process, so students can make use of what they already know. This knowledge can also help to predict what might be said in the situation or simply what is it all about. - AB, RAF2', 395, 'frkjPi', 'HelplessLightningBug', 1),
('88c2bc28626011ecbab300e04c680140', 'like', 189, 'FasKpi', 'StrongHartebeest', 1),
('88c2d6a6626011ecbab300e04c680140', 'In this video I got to know that the most important thing in reading or listening exercises during the classes is that the teacher is obliged to choose a proper and interesting text, so the students are motivated to participate in this classes and they simply like to work on such text. What is more, such text must be on the appropriate level so the lesson will go well and students will feel more comfortable. - AB, RAF2', 189, 'FasKpi', 'StrongHartebeest', 1),
('88c2fb1c626011ecbab300e04c680140', 'like', 161, 'y7wmSb', 'FlawlessDorado', 1),
('88c319a0626011ecbab300e04c680140', 'The author says that after choosing an interesting text, it is good to make some kind of an introduction. Teacher needs to activate schemata and raise students’ interest. It is easier for students to understand something better when they know what is it going to be about. So the good way is to start by motivation like for example using an image, setting personalised discussion or setting a task in a few groups. -AB, RAF2', 160, 'y7wmSb', 'FlawlessDorado', 1),
('88c33506626011ecbab300e04c680140', 'like', 140, '7967Vc', 'WidePygmy', 1),
('88c35416626011ecbab300e04c680140', 'like', 140, '7967Vc', 'WidePygmy', 1),
('88c37060626011ecbab300e04c680140', 'The most important thing in this video is that the author puts pressure on do’s& don’t’s during the pre-teaching vocabulary. Teacher needs to make sure that students know the meanings of the words. If not, one needs to teach them the words but in a very limited way. Instead of teaching all the words in the text it is good to teach only those that the students will need to know to do the exercises. What is more, such words have to be introduced in a context.- AB, RAF2', 140, '7967Vc', 'WidePygmy', 1),
('88c39ace626011ecbab300e04c680140', 'like', 244, 'npQXT2', 'MurkyGhostshrimp', 1),
('88c3bf2f626011ecbab300e04c680140', 'The most important things that the author says is that when teacher asks students questions about the text, he or she should avoid creating them with the same words as in the text, because that will be too simple and it will not teach anything. Another key thing is to focus on peer check, so it is important to nominate students when it comes to answering the questions, so that every student will understand the text, not only the confident ones. It is also crucial to ask why, or where is it in the text. - AB, RAF2', 259, 'npQXT2', 'MurkyGhostshrimp', 1),
