('88e759e0626011ecbab300e04c680140', ' I\'d agree that it\'s best to use all the strategies when working on listening skills. We deal with different kinds of learners and if we want to improve their knowledge as well as sustain their interest in the language, we need to vary the activities. The strategy \"little and often\" sounds like a good solution when it comes to bottom up teaching.  \nNice video, I liked the examples. /KL', 523, 'E6zJn2', 'DeliriousWaterbuck', 1),
('88e79150626011ecbab300e04c680140', 'Even if top down teaching is \'just practicing\', the students are still learning; if not new material, then some prediction skills, guessing, deducting, etc., all of which, I\'d say, are very important in communication. Moreover, it\'s motivating for the learners if they manage to anticipate e.g. what is going to be said in a video, and they understand the content better if they\'re encouraged to use their prior knowledge. /KL', 377, 'frkjPi', 'OutlyingBigMouthBass', 1),
