('88e8646c626011ecbab300e04c680140', 'Easier said than done - choosing a text that is both interesting and has appropriate level is challenging for me. I remember observing a lesson in which students read a fragment from Jane Austen\'s book, and I myself would be delighted to practice language on such  an example, but the majority of the learners seemed very bored. The groups in Polish schools are quite big (sometimes around 20 people in a group), and therefore, choosing something that suits everyone\'s interests is virtually impossible. KL-MA', 190, 'FasKpi', 'ImpishIslandWhistler', 1),
('88e88867626011ecbab300e04c680140', 'like', 43, 'y7wmSb', 'WordyOrca', 1),
('88e8a77b626011ecbab300e04c680140', 'Not only is it easier to understand something, but activating schemata also engages the students in an activity - they become more interested if e.g they want to check whether their predictions were right. KL-MA', 85, 'y7wmSb', 'WordyOrca', 1),
('88e8c637626011ecbab300e04c680140', 'I especially like asking the students these personal questions, like in the example - what was YOUR favourite toy. The learners usually enjoy talking about their experiences, and it\'s more fun to find about your peers\' likes, interests, etc. KL-MA', 155, 'y7wmSb', 'WordyOrca', 1),
