('88e926c0626011ecbab300e04c680140', 'I consider peer check a very important step - it gives the students more confidence when they can compare answers, they don\'t feel that stressed when later they need to share them with the rest of the group. KL-MA', 92, 'npQXT2', 'DrabMarten', 1),
('88e9424a626011ecbab300e04c680140', 'Moreover, when nominating, I try to first ask the question, give some time, and only later choose a student to answer it. This way, I make sure everyone\'s focused, trying to think of the right answer. KL-MA', 115, 'npQXT2', 'DrabMarten', 1),
