('88f86302626011ecbab300e04c680140', 'In this video I got to know why is it important to give students clear instructions during the lesson. It is the most efficient way because it gives students confidence in me as a teacher and my lesson can go well. A few ways to achieve that are first of all: planning this instructions and deciding what I want to say. Secondly, it is important to draw students\' attention,  speak clearly with using short sentences and simple language. Instructions cannot be difficult, even for students on higher levels. I also have to make sure that everybody from the classroom can hear me. What is more, one of the most efficient ways of giving instructions is simply demonstration. Teacher can use visual or written instructions and he or she can also use gestures, body language, even facial expressions. It can also be pointing out things. There cannot be too many of these instructions, it is better to divide them into smaller steps. Then, teacher has to make sure that all of them know what to do by usin', 758, 'hS18NW', 'UpbeatUakari', 1),
