('892b79e8626011ecbab300e04c680140', 'Very general. I suppose that\'s a very typical introduction, so there\'s not much to say. KU. ', 190, 'FasKpi', 'JitteryAmericanRedSquirrel', 1),
('892b9048626011ecbab300e04c680140', 'A very clear and easy to follow video. Nothing new, though. I think that\'s a good summary of what we learned during our BA, though. KU-MA. ', 154, 'y7wmSb', 'KnownNilgai', 1),
('892bb3c7626011ecbab300e04c680140', 'Another clear and easy to follow video. However, it\'s still just a summary of what we learned during our BA. KU-MA', 132, '7967Vc', 'WealthyKinkajou', 1),
('892bd27f626011ecbab300e04c680140', 'Still nothing new, but I really don\'t mind, since she stresses the importance of feedback and peer check, which i find really important. KU-MA', 312, 'xOBiip', 'IdealBlackbuck', 1),
('892bf08b626011ecbab300e04c680140', 'Quite a nice summary of the most important elements of teaching receptive skills! KU-MA', 275, 'npQXT2', 'Bite-sizedRainbowLorikeet', 1),
('892c0a72626011ecbab300e04c680140', 'Quite interesting, but really short and it could be a little bit more informative. All of the things mentioned in the video are crucial for teachers, and it\'s good to go back to the basics from time to time. KU-MA', 384, 'frkjPi', 'PrudentHornedToad', 1),
('892c25c9626011ecbab300e04c680140', 'Some aspects could be talked about in greater detail, but generaly a very nice video. I like the fact that she stressed the importance of understadning (and teaching about) connected speech. KU-MA', 522, 'E6zJn2', 'ShadowyHornbill', 1),
