('892dff16626011ecbab300e04c680140', 'I also have met some students who are very reluctant to talk, as they do not want to make mistakes. I think it all depends on the way teachers correct their students. ', 215, 'p11S0y', 'SpryMuskrat', 1),
('892e1a0f626011ecbab300e04c680140', 'As I said earlier ( I didn\'t add my initials), it\'s important to create a good atmosphere so students will feel comfortable while talking. MS-MA', 250, 'p11S0y', 'SpryMuskrat', 1),
('892e3819626011ecbab300e04c680140', 'Of course it\'s important to make them sure that their speech will be well-received, but it\'s more difficult to make sure other students wont laugh or make rude comments.', 449, 'p11S0y', 'SpryMuskrat', 1),
('892e511e626011ecbab300e04c680140', 'I like this exercise as many students have problems with collocations, which, by the way, make our speech more fluent.', 1212, 'p11S0y', 'SpryMuskrat', 1),
