('893d9faf626011ecbab300e04c680140', 'like', 512, 'G0zWCs', 'UnhappyHoverfly', 1),
('893dbbb0626011ecbab300e04c680140', 'I understand and agree with the point of saving time explaining  something in the mother tongue rather than in the target language, but on the other hand, it can quickly become a harmful habit; what I usually observed during my teaching practice was that many vocabulary items were immediately translated to Polish by the teacher as she didn\'t want to \'waste\' some more time trying to explain them in English. I\'m not against using the mother tongue and translation but I believe the students benefit more if they\'re sometimes forced to using the foreign language instead of choosing the easier way. KL-MA', 942, 'p11S0y', 'MistyMink', 1),
('893ddd0e626011ecbab300e04c680140', 'I\'d agree that when it comes to fluency tasks, students shouldn\'t be interupted while speaking, unless the error changes the meaning of the utterance. Be this as it may, I found that sometimes students do not really want to believe they made some minor mistakes, e.g. missed an article, swallowed an \'s\' ending in 3rd person singular, etc. when they receive feedback after some time. KL-MA', 1061, 'p11S0y', 'MistyMink', 1),
('893df7e3626011ecbab300e04c680140', 'I think the idea of chants is lovely, but only for the younger students - I just cannot imagine the high school group I taught most often chanting in this rhythm - they hesitated even during simple drills. It\'s also difficult to check the right pronunciation when the whole class is speaking at the same time. Naturally, as mentioned, they can later practice in smaller groups/pairs, but we still need to monitor it somehow, and if we ask a student to chant individually, even after some practice, I fear it could be very awkward for them. KL-MA', 1631, 'p11S0y', 'MistyMink', 1),
('893e12f1626011ecbab300e04c680140', 'Yeah, I especially agree with the accumulation of interactive chunks - when students see that they learn useful phrases, I believe they remember them much better. Such exercises also show the communicative purpose of learning the language. KL-MA', 1756, 'p11S0y', 'MistyMink', 1),
('893e2bcc626011ecbab300e04c680140', 'Moreover, when students mingle, they\'re forced to leave their comfort zone to speak with more people than usual. In my view, it\'s very good if you change your speaking partnets, even if for such a short activity. KL-MA', 2200, 'p11S0y', 'MistyMink', 1),
('893e463c626011ecbab300e04c680140', 'It\'s an interesting activity, but can be very stressful for the representative - he/she\'s the responsible one here, and might feel stupid for not understanding the prompts from their group. I would use this exercise if I had some revision lessons planned. KL-MA', 2372, 'p11S0y', 'MistyMink', 1),
('893e632d626011ecbab300e04c680140', ' I\'m not sure whether I agree with this one - even more confident students can feel frustrated if they cannot finish their utterance since they\'re being interrupted because of their mistakes. If we want to practice fluency, we also need to put emphasis on what the students are saying; otherwise, they will start to feel like their opinion is not important and the only goal of the activity is to point out their errors. KL-MA', 3105, 'p11S0y', 'MistyMink', 1),
('893e7c3d626011ecbab300e04c680140', 'I cannot imagine a situation in which I want to evaluate my students and they don\'t know they\'re being graded. I think it\'s extremely unfair and in the future it would cause even more panic among the students, who would never know what to expect from the teacher. KL-MA', 3279, 'p11S0y', 'MistyMink', 1),
