('893f6d20626011ecbab300e04c680140', 'I really enjoyed this webinar. I liked the advice on not telling asilent student ‘ Oh, wonderful how good that you’re speaking’ as it can discourage them and bring the attention which the student is trying to avoid. What I found very useful was the ideas and ways in which the teacher can adapt  and change one exercise to students’ needs and level. The idea with conjecturing and ‘find somebody who’  was also interesting. Those tasks can encourage students to speak. From my experience those types of exercises help students relax and get to know each other more. Additionally, ‘Say things about’ was an activity that I have try with my students because I believe it would be interesting and fun. I also liked the idea of evaluating the students not on the basis of correctness but on the basis of getting their idea across. Self-evaluation task was useful and I will definitely use it the future. However, I am not sure about the dialogue. I believe that some students may feel uncomfortable perfo', 3644, 'p11S0y', 'PlayfulZooplankton', 1),
