('895e0ea5626011ecbab300e04c680140', 'I find this webinar really interesting and helpful. I have been teaching online for some time now and I must admit that it’s quite difficult job to do. Not only is it hard to organise and prepare materials for the class, but also maintaining discipline is challenging. This webinar helps me to look at online teaching from a different angle – now it is something challenging in a way that I want to do it. There are lots of fantastic ideas for activities (one-minute check in, different task-based activities) and I appreciate that every activity was supported with examples. Thanks to that I know how to prepare materials and make my online lessons engaging for students. Interestingly, when we come back to normal – real – teaching, I will be able to use these activities in the classroom, which I also really like. PD-MA', 3505, '9iS4YS', 'AccurateDunnart', 1),
('895e303c626011ecbab300e04c680140', 'Drawing from my own experience, I\'d say that most of the time the students avoid speaking because they are afraid of making mistakes. KU-MA', 225, 'p11S0y', 'StupidHart', 1),
('895e4d47626011ecbab300e04c680140', 'I\'m not sure if I\'d agree with the statement that it\'s best to avoid planning speaking activities until the students know everyone in their group. I guess that there are many activities that are supposed to bring people together and the sooner we give the sts the opportunity to get to know everyone, the better. KU-MA', 401, 'p11S0y', 'StupidHart', 1),
('895e6795626011ecbab300e04c680140', 'I think that she\'s got a point there. I\'ve seen many teachers who talked probably much more than necessary and gave detailed feedback during various speaking activities. I think that it\'s not always the best idea to correct every mistake the sts make. KU-MA', 1122, 'p11S0y', 'StupidHart', 1),
('895e82b1626011ecbab300e04c680140', 'I really like the idea (of deleting one of the columns and eliciting some responses from the sts) KU-MA', 1339, 'p11S0y', 'StupidHart', 1),
('895ea3d9626011ecbab300e04c680140', 'Overall, that was really a very thought-provoking video. I\'ll definitely use some of the strategies mentioned, and she was right about a number of things. KU-MA', 2564, 'p11S0y', 'StupidHart', 1),
