('8962bb1f626011ecbab300e04c680140', 'This video is motivational but void of any knowledge or lesson we do not already posses or encounter at school. They say to read more books, and some of us do, sure, yet others got to be successful without hard work in this field. I think it is way more important to teach people why reading or studying is salient to us as human beings, not how that could get us to earn money or let the world know our name. You study because you want to get to know your surroundings, you read because it provides information or pulls you into a world of fantasy, where reality does not matter anymore. And at the end of the day you do these things to strengthen your connection to your body and soul, and when needed, you allow yourself take a break. Take a break until you are ready to give your best again. If we really want to motivate people, we shall motivate them for the right reasons, let them know the real benefits. - Șagău Cristina', 0, 'DK5GSJ', 'CluelessIriomoteCat', 1),
