('896b9706626011ecbab300e04c680140', 'Molti dei partecipanti, me compreso, sono studenti di ingegneria elettronica che stanno seguendo o hanno seguito il Suo corso di Analisi funzionale e trasformate. In quel corso non vengono trattati i problemi di Sturm-Liouville. Sebbene non sia necessaria la conoscenza di tale argomento, sarebbe interessante conoscere qualcosa in più al riguardo prima di vedere questo esempio. Inoltre l\'oscillatore armonico quantistico è stato trattato anche in altri corsi in cui si è fatto solo un cenno ai polinomi di Hermite senza capire bene da dove venissero fuori. Consiglio, pertanto, per gli anni successivi, di includere tra i prerequisiti di questo corso tali argomenti, in modo che lo studente interessato possa andare a leggere il paragrafo relativo prima di seguire la lezione.', 5764, 'rgF7fI', 'francesco.faillace@mail.polimi.it', 1),
