('8999aa31626011ecbab300e04c680140', 'Após a visualização do vídeo, acho pertinente abordar um ponto chave explorado pela oradora. Achei bastante interessante a ideia de que a postura corporal que adotamos tem muito impacto no nosso sucesso profissional/pessoal. Para além disso, é de certa forma curioso que os animais irracionais também a usam ainda que seja por instinto. Contudo, nós como seres humanos, podemos fazer uso do nosso livre arbítrio para escolher o momento em que passamos a adotar uma postura dominante e mais relaxada (no sentido de não sucumbir em situações de stress). Tendo em conta que hoje em dia a concorrência é feroz e o mercado de trabalho é muito competitivo não há outra opção senão por de lado as nossas inseguranças e adotar uma posição de confiança, mesmo que a “fingir”, pois acredito que mais tarde acabamos por nos tornar aquilo que ao princípio fingimos ser.  J. André Freitas 2160587', 4, 'sHlzDQ', 'MedicalWaterMoccasin', 1),
('8999c51a626011ecbab300e04c680140', 'O vídeo começa com o boneco verde a queixar-se que naquela organização ninguém aceita as suas ideias, porque as pessoas têm medo da mudança, mas é imediatamente abordado pelo boneco vermelho que o contradiz.  Desta forma, o boneco verde começa a colocar-lhe um conjunto de situações hipotéticas, como por exemplo subir uma montanha algo que é rejeitado pelo colega mesmo que no topo dessa montanha esteja um pote com ouro. E neste ponto acredito o boneco vermelho assume um medo de ataque, uma vez que se sente ameaçado perante uma situação nova. Contudo, após o colega oferecer-lhe ainda mais benesses, ele rejeita a proposta de novo, mas aqui já se trata de um medo de perda, pois ele assume que se sente mais confortável na situação atual e que não precisa de subir a montanha. Os colegas vão trocando argumentos, mas acabam por concordar que numa situação de mudança é importante adaptar a mudança a cada um, ou seja, as pessoas só mudam se for benéfico para SI. Por isso, concluo que implementar', 343, 'dfzthw', 'MysteriousEnglishSetter', 1),
