('89a64581626011ecbab300e04c680140', 'Muito enriquecedor! Importante para expandir o nosso pensamento e ter em conta todos os aspetos que envolvem uma mudança, para nós e para o outro.', 343, 'dfzthw', 'MurkyZebraSwallowtailButterfly', 1),
