('89a7d34d626011ecbab300e04c680140', 'like', 888, 'sHlzDQ', 'FrivolousAfricanAugurBuzzard', 1),
('89a7ec5d626011ecbab300e04c680140', 'Nesta palestra é abordado um tema muito relevante, presente no dia-a-dia de toda gente, e que não é devidamente reconhecido. Eu achei este vídeo muito pertinente e fiquei a conhecer algumas técnicas simples que poderei utilizar no futuro para alcançar aquilo que ambiciono.', 1252, 'sHlzDQ', 'PertinentBaleenWhale', 1),
('89a8092d626011ecbab300e04c680140', 'Por norma há sempre alguma resistência a mudança. Tem que haver sempre algo benéfico para as pessoas, para que se reduza a resistência.  ', 77, 'dfzthw', 'ForsakenCrab', 1);
INSERT INTO `reaction` (`rid`, `type`, `at_second`, `video_code`, `user_name`, `visible`) VALUES
('89a82886626011ecbab300e04c680140', 'Na minha opinião este vídeo retrata muito bem todas as fases necessárias para conseguir implementar uma mudança que seja bem aceite. De uma forma instintiva, eu considero que as pessoas resistem a qualquer mudança porque adotam um comportamento de conformismo e é desafiante conseguir a alterar o comportamento de uma pessoa. Desta forma, ao longo do processo de mudança a comunicação assume um papel de destaque, sendo o meio mais assertivo a utilizar para alcançar um consenso.', 354, 'dfzthw', 'DarlingDromedary', 1),
('89a84721626011ecbab300e04c680140', 'A linguagem corporal tem um papel significativo não só na maneira como as outras pessoas nos veem, mas também na maneira como nós nos sentimos connosco. Adotar uma linguagem corporal confiante, faz-nos ter uma atitude mais positiva para com situações de desconforto. A incerteza do que irá acontecer é o que nos deixa nervosos, não sabermos aquilo para o que vamos. Ao adotar uma linguagem corporal positiva, encaramos essa situação de maneira diferente, de forma a conseguir enfrentá-la até ficarmos familiarizados com ela e nos tornemos preparados para tal.', 5, 'sHlzDQ', 'ShinyScarletIbis', 1),
('89a86eae626011ecbab300e04c680140', 'Resistir à mudança é algo \"natural\" nas pessoas. Sair da zona de conforto requer muita força de vontade, e uma preparação muito cuidada. Temos de salientar o bom da mudança e o mau de não a fazermos, tendo em consideração que cada individuo tem uma personalidade única, e as suas perspetivas destes aspetos são diferentes uns dos outros. ', 0, 'dfzthw', 'DeadDalmatian', 1),
('89a887f7626011ecbab300e04c680140', 'Se ainda havia dúvidas sobre o poder da linguagem corporal com este vídeo deixou de haver. É muito interessante ver as diferenças e os resultados que se pode alcançar apenas com a linguagem corporal.', 1170, 'sHlzDQ', 'HarmfulEasternGlassLizard', 1),
('89a8a423626011ecbab300e04c680140', 'É uma verdade, resiste-se sempre ás mudanças e neste caso, dentro de uma organização, é necessário explicar as vantagens do ponto de vista de cada um de forma a que todos encarem a mudança como algo benéfico.', 335, 'dfzthw', 'QuirkyQuoll', 1),
('89a8bdd3626011ecbab300e04c680140', 'like', 343, 'dfzthw', 'HotHamadryad', 1),
('89a8d74e626011ecbab300e04c680140', 'Conseguir mudar o mindset de uma empresa não é trabalho de apenas uma pessoa... são da várias. É impossível apenas com o esforço de uma conseguir ultrapassar a resistência à mudança do nível institucional, tático e operacional; é preciso uma equipa.', 347, 'dfzthw', 'HotHamadryad', 1),
('89a8f73b626011ecbab300e04c680140', 'like', 1115, 'sHlzDQ', 'ThreadbareChrysomelid', 1),
('89a9160c626011ecbab300e04c680140', 'Nunca tinha tido em conta as poses corporais quando comunico com uma pessoa... ', 1117, 'sHlzDQ', 'ThreadbareChrysomelid', 1),
('89a9341b626011ecbab300e04c680140', 'like', 1233, 'sHlzDQ', 'DeficientConure', 1),
