('89aa7b8a626011ecbab300e04c680140', 'like', 1197, 'sHlzDQ', 'FunnyBuffalo', 1),
('89aa998b626011ecbab300e04c680140', 'like', 82, 'dfzthw', 'ViciousNutria', 1),
('89aab443626011ecbab300e04c680140', 'like', 339, 'dfzthw', 'ViciousNutria', 1),
('89aacd40626011ecbab300e04c680140', 'Com este vídeo, percebi que a linguagem corporal demonstra o poder que as pessoas podem ter numa situação de stress. O importante é fingir até nos tornarmos a pessoa que gostaríamos de ser.', 7, 'sHlzDQ', 'TremendousAngwantibo', 1),
('89aaec92626011ecbab300e04c680140', 'A linguagem corporal tem uma grande importância no que toca à interação social. Através dela, conseguimos demonstrar confiança e poder, melhorando a nossa comunicação.', 9, 'sHlzDQ', 'TremendousAngwantibo', 1),
('89ab0732626011ecbab300e04c680140', 'Este vídeo fez-me perceber que, através de uma comunicação adequada às necessidades de cada indivíduo, uma organização consegue implementar uma mudança. Assim, é importante ter em conta os aspetos positivos e negativos de mudar ou não. ', 4, 'dfzthw', 'MarvelousImpala', 1),
('89ab232e626011ecbab300e04c680140', 'Quando se propõe uma mudança a nível organizacional, é preciso transmitir de forma clara qual a vantagem de mudar. Para isso, o responsável pela mudança, deve tentar entender que aspeto pode ser entendido como positivo para cada indivíduo.', 5, 'dfzthw', 'MarvelousImpala', 1),
('89ab41d6626011ecbab300e04c680140', 'Com este vídeo percebi que a linguagem corporal é um aspeto que tem influência no comportamento do indivíduo em situações de stress. Assim, podemos fingir ser confiantes até realmente sê-lo. ', 0, 'sHlzDQ', 'NaturalHornet', 1),
('89ab5e6c626011ecbab300e04c680140', 'A linguagem não verbal pode mudar o modo como nos sentimos e como agimos em contexto de interação social. Praticando poses de poder, é possível sentir-mo-nos poderosos e fazer coisas que pensávamos não ser capazes.', 0, 'sHlzDQ', 'StableAmericangoldfinch', 1),
('89ab7d12626011ecbab300e04c680140', 'like', 0, 'dfzthw', 'Good-naturedCapeGhostFrog', 1),
('89ab9674626011ecbab300e04c680140', 'No inicio a personagem P parece claramente alguém que resiste à mudança, mas no final do vídeo quando ele explica que cada pessoa tem a sua visão do que seriam as suas vantagens e desvantagens fez com que compreendesse melhor o ponto de vista dele, uma vez que eu, assim como o personagem M não estava a ter esses fatores em conta.', 0, 'dfzthw', 'Good-naturedCapeGhostFrog', 1),
('89abb724626011ecbab300e04c680140', 'È possibile che alcuni operatori siano comunque limitati? Penso al fatto che fisicamente emerge che un corpo massivo non possa superare la velocità della luce, quindi sarei indotto a pensare che un eventuale \'\'operatore velocità\'\' sia effettivamente limitato da una costante. Come si sposa questa considerazione? ', 3038, 'zvCzc1', 'andrea.baglivo@mail.polimi.it', 1),
('89abd16e626011ecbab300e04c680140', 'like', 1248, 'sHlzDQ', 'TerrificBaiji', 1),
('89abee1a626011ecbab300e04c680140', 'Eu já tinha visto este video na unidade curricular de comunicação internacional multimodal e eu acredito firmemente em tudo o que a senhora fala ao longo do video. A minha mãe é hipnoterapeuta e por isso cá em casa nós temos um post-it no espelho da casa de banho que diz \"Eu consigo, eu quero e vou ...\" onde as reticencias representam um objetivo ou sonho, e ao acordar de manhã e olhar para o espelho nós temos de repetir estas palavras 3 vezes. O que é que isto tem a ver com esta Ted Talk? Tudo, pois tanto a comunicação não verbal de poder, como a comunicação verbal podem mudar-nos, porque ao fazer estes processos todos os dias nós estamos a comunicar com o nosso inconsciente e por isso é que nós não nos damos conta de quando nos tornamos no que queríamos, como a senhora referiu no video, porque em grande parte envolve o inconsciente. Eu já usei a técnica dos 2 minutos numa posição de poder algumas vezes depois de a ter conhecido e realmente acho que faz diferença. Para mim este é um v', 1254, 'sHlzDQ', 'TerrificBaiji', 1),
