('89ad5292626011ecbab300e04c680140', 'Ho visto il paradosso EPR in un corso di ottica quantistica e spero di poter fare qualche considerazione utile. In questo paper viene accusata la meccanica quantistica di essere incompleta: EPR considerano 2 sistemi quantistici che hanno interagito e sono portati a distanze molto elevate (anni luce) per esempio uno sulla terra e uno su Andromeda . Nel momento in cui hanno interagito, secondo la MQ, le 2 particelle sono correlate, ovvero sono descritte da un\'unica funzione d\'onda. La loro analisi si basa su due principi \'\'classici\'\': REALISMO e LOCALITA\'. Se consideriamo infatti due variabili che non commutano, es posizione e momento, se nel sistema sulla terra misuriamo la posizione, nel sistema su Andromeda la posizione diverrà un elemento di realtà, ovvero una grandezza misurabile (lo stesso avviene per il momento). La criticità è che se nel sistema sulla terra misuriamo  la posizione e poi il momento, su Andromeda divengono entrambi elementi di realtà (poichè misuro sulla terra), tu', 6606, 'qxd8ic', 'andrea.baglivo@mail.polimi.it', 1),
('89ad6bfe626011ecbab300e04c680140', 'Na minha opinião, as mudanças são algo que, acontece espontaneamente, apanhando pessoas de surpresa, e consequentemente causando alguma resistência à mesma. Porém, pode ser provocada propositadamente e com a intenção de alterar um ou outro aspeto. Contudo, para que uma mudança seja aceite, é necessário ter em conta os pontos de vista de quem irá sofrer a mudança, tanto aspetos positivos como negativos, e os mesmos aspetos para a situação em que a pessoa já se encontra.', 0, 'dfzthw', 'BuzzingReptile', 1),
('89ad8813626011ecbab300e04c680140', 'like', 637, 'sHlzDQ', 'ZealousIrukandjiJellyfish', 1),
