('89b252a7626011ecbab300e04c680140', 'Concordo completamente com a mensagem que foi transmitida neste vídeo, uma vez que me fez relembrar situações pelas quais passei. Um exemplo dessas situações foi a entrada na faculdade, visto que durante 2 anos nunca acreditei que fosse possível, sempre pensei que a faculdade não era um lugar para mim, no entanto, o meu subconsciente nunca me deixou desistir ao ponto de melhorar todas as notas necessárias do secundário e receber um email do ISCAP a aceitar a minha candidatura! Desta forma, identifiquei-me imenso com as palavras da Amy Cuddy, porque eu também pensava e dizia em voz alta, imensas vezes, que não deveria estar aqui.', 1259, 'sHlzDQ', 'QuestionableWorm', 1),
