('89b28b20626011ecbab300e04c680140', 'A mensagem que retirei deste vídeo foi a seguinte: qualquer situação de mudança que se queira realizar numa organização vai ser complicada, uma vez que os indivíduos têm medos e receios sobre perder aquilo que conquistaram até agora e perder a sua rotina, assim como também se sentem retraídos porque mudar significa aprender novas competências e pode haver sempre alguém que se torne melhor do que eles. No entanto, a mudança não é impossível se nos dedicarmos realmente a esse processo, sendo que existem várias razões que levarão os membros de uma empresa a aceitar e ficarem motivados acerca dessa situação. Mas, tal como referido no vídeo, todos os indivíduos têm interesses e necessidades diferentes e, só conhecendo esses parâmetros é que se torna realmente possível agradar e satisfazer as necessidades de todos os membros. Não é fácil e não se realiza esse processo de um dia para o outro, podendo levar meses ou anos. A persistência e dedicação dos líderes é importante nesta caminhada, ass', 0, 'dfzthw', 'WarmDorado', 1),
