('89cc85ae626011ecbab300e04c680140', 'Sunt de acord cu modalitatea abordată de domnul Mihăilescu. Lectura de poate scăpa de deficitul pe care îl ai, de complexele tale, de poate transpune într-o altă lume, imaginată de tine. ', 97, 'yXgtqV', 'ShoddyGeese', 1),
('89cc9c34626011ecbab300e04c680140', 'Sunt de acord și cu faptul că nu trebuie să îi judecam pe oameni dacă nu citesc, este alegerea lor, însă eu sunt sigura că au de pierdut, deoarece în timp ce citești o carte, treci prin tot felul de trăiri. Eu îndemn oamenii din jurul meu să citescă, este la latitudinea fiecăruia dacă dorește sau nu.', 100, 'yXgtqV', 'ShoddyGeese', 1),
('89ccb5ba626011ecbab300e04c680140', 'Sunt de acord cu faptul ca lectura îți da o buna ocrotire sufleteasca, pe mine mereu sa ajuta sa imi găsesc liniștea, sa imi înec supărările, pot spune ca lectura este un foarte bun doctor.', 245, 'yXgtqV', 'ShoddyGeese', 1),
('89ccd07b626011ecbab300e04c680140', 'like', 317, 'yXgtqV', 'ShoddyGeese', 1),
('89ccea15626011ecbab300e04c680140', 'Sunt total de acord, un om care citește e un om care automat este văzut altfel, se exprima altfel, găsește altfel, este foarte important ca la un interviu sa îți arați aceasta latura. Esti mult mai privilegiat dacă cunosti anumite lucruri, pe care, cel dinastea ta, la un interviu nu le știa. Automat captezi atenția si angajatorul își da seama ca esti isteț si te vrea angajat, crești in ochii oamenilor prin modalitatea in care te educi.', 317, 'yXgtqV', 'ShoddyGeese', 1),
('89cd0317626011ecbab300e04c680140', 'like', 429, 'yXgtqV', 'ShoddyGeese', 1),
('89cd1efe626011ecbab300e04c680140', 'Tot respectul pentru oamenii care se întrețin datorită lecturii, este o sursa foarte frumoasa de venit, relaxanta si optima pentru minte si suflet. Cunosc multă lume care ma întreaba la ce facultate sunt imi spun fix așa: ,,A, a-i sa mori de foame.” Eu rămân socata când aud acest lucru, nu înțeleg aceasta gândire. Meseria pe care o vei face toată viața, trebuie sa fie o meserie pe care o iubești. Dacă iubești ceea ce faci, vei fi prosper pe toate planurile.', 429, 'yXgtqV', 'ShoddyGeese', 1),
