('89cd86b0626011ecbab300e04c680140', 'Doar un om citit poate deschide orice usa a unei companii. Foarte multi angajatori tin cont de cunoștințele generale ale angajaților, indiferent de domeniu', 344, 'yXgtqV', 'StainedAsianWaterBuffalo', 1),
