('89cdfcb1626011ecbab300e04c680140', 'Doi oameni citiți au conversații mult mai profunde, iar un cuplu de oameni citiți vor avea cu siguranta o relație mai profunda decat doi oameni necititi, deoarece lectura ne dezvolta si ne ajută să ne cunoaștem cel mai bine. În acest fel șansele ca un tanar/ o tânără sa se îndrăgostească de persoana potrivita cresc semnificativ.', 523, 'yXgtqV', 'StainedAsianWaterBuffalo', 1),
('89ce1999626011ecbab300e04c680140', 'like', 403, 'yXgtqV', 'TalkativePanda', 1),
('89ce3632626011ecbab300e04c680140', 'like', 29, 'yXgtqV', 'SteelLemming', 1),
('89ce5425626011ecbab300e04c680140', 'Această metodă de a face oamenii să citească este, cred eu, una dintre cele mai bune. Dacă persoana se simte bine și este împăcată cu gândul că a citi înseamnă o pierdere de timp, dacă s-ar apuca să citească chiar ar deveni o pierdere de timp, deoarece lectura se face de plăcere, cu inima și creierul deschis și receptiv asupra universului lecturii. Dacă stăm să citim doar de dragul „modei” sau că am fost puși să citim atunci e o mare pierdere de timp, deoarece lectură nu se poate numi, deoarece lectura este o atitudine; citești o carte ca să poți să ai o atitudine despre aceea operă, citești cărțile unui autor ca să poți să ai o atitudine critică asupra autorului respectiv și citești cărți pentru a putea avea o atitudine asupra literaturii. ', 29, 'yXgtqV', 'SteelLemming', 1),
