INSERT INTO `reaction` (`rid`, `type`, `at_second`, `video_code`, `user_name`, `visible`) VALUES
('89d35a76626011ecbab300e04c680140', 'Molto chiara l’introduzione sui due approcci, ondulatorio e algebrico, sviluppati rispettivamente da Schrödinger e da Heinsenberg et al. Azzeccato il commento sulla località e globalità, rispettivamente, degli operatori differenziali e integrali al minuto 00:28:00. È una cosa che personalmente davo per scontata ma che mi ha aperto nuovi spunti di riflessione. L’introduzione storica è stata sviluppata al meglio, relativamente al poco tempo a disposizione, e molto di quanto spiegato era una grande curiosità che solitamente negli insegnamenti che coinvolgono la meccanica quantistica non viene fornita. Sicuramente è stato interessante sapere come i matematici si siano interessati all’argomento e quali fossero i differenti approcci di matematici e fisici nel conciliare la matematica con la fisica. Riguardo alla seconda parte della lezione, ringrazio il docente per aver puntualizzato la diversa convenzione con cui si definiscono gli assiomi del prodotto scalare. Nonostante i numerosi insegna', 6319, 'cIS7zS', 'andrea1.santi@mail.polimi.it', 1),
('89d373ad626011ecbab300e04c680140', 'Non mi è risultato chiaro il concetto di misura \"concentrata\", nonostante la definizione data poco più avanti', 1652, 'KG3kLQ', 'jacopostefano.ragazzini@mail.polimi.it', 1),
('89d38f58626011ecbab300e04c680140', 'Quest\'ultima lezione forse è stata la più difficile, ma comunque si riusciva a seguire. Forse si poteva spiegare meglio cosa sono gli integrali a valori operatoriali e farne degli esempi', 6320, 'KG3kLQ', 'jacopostefano.ragazzini@mail.polimi.it', 1),
