('89d4cfd3626011ecbab300e04c680140', 'Chiara la parte sui funzionali fino al minuti 00:27:25, però non sono riuscito a seguire bene il filo del discorso. Per esempio, riascoltando non ho ben capito cosa sia il ‘duale’ di uno spazio e quale sia la sua importanza. Contentissimo di aver finalmente sentito parlare di aggiunto di un operatore, alla fine dell’esempio sull’aggiunto dell’operatore trasformata di Fourier, minuto 01:30:11 circa, ho trovato la risposta a domande che erano rimaste irrisolte per quasi tre anni. La spiegazione dell’aggiunto di un operatore è stata semplice, diretta ed efficace. Altrettanto lo è stata l’introduzione agli operatori simmetrici.', 6211, 'VNpT1h', 'andrea1.santi@mail.polimi.it', 1),
('89d4eca0626011ecbab300e04c680140', 'Buongiorno, le due disuguaglianze \n(1): ||f * g|| <= ||f|| ||g|| \n(2): ||fg|| <= a/2 ||f||^2 + 1/2a ||g||^2 per ogni a>0, \nsono indipendenti? (Usando le norme appropriate) \nMi viene il dubbio perché chiamavo la seconda disuguaglianza di Young', 5266, 'cIS7zS', 'paolojoseph.baioni@mail.polimi.it', 1),
('89d510fa626011ecbab300e04c680140', 'È interessante avere per una volta una contestualizzazione anche storica della matematica, che è sempre stata tralasciata in altri corsi', 3038, 'cIS7zS', 'filippo.martinelli@mail.polimi.it', 1),
('89d53138626011ecbab300e04c680140', 'Finalmente una trattazione rigorosa di questa proprietà degli operatori, che invece era sempre stata data un po\' per buona ', 5122, 'VNpT1h', 'filippo.martinelli@mail.polimi.it', 1),
('89d54f37626011ecbab300e04c680140', 'Ho apprezzato molto questo \"ripasso\" delle variabili aleatorie che sono un concetto che viene introdotto nei primi anni quando ancora non c\'è sufficiente maturità per capirlo', 1637, 'zvCzc1', 'filippo.martinelli@mail.polimi.it', 1),
('89d5722e626011ecbab300e04c680140', 'Una cosa che mi stavo chiedendo a posteriori e che forse meriterebbe essere approfondita in futuro è come si legano queste definizioni matematiche con il concetto di Bra e Ket di Dirac, o se sono solo una rappresentazione alternativa', 883, 'qxd8ic', 'filippo.martinelli@mail.polimi.it', 1),
('89d59139626011ecbab300e04c680140', 'La ringrazio per il corso, l\'ho apprezzato e trovato molto interessante', 6294, 'KG3kLQ', 'filippo.martinelli@mail.polimi.it', 1),
