('89ebdb18626011ecbab300e04c680140', 'Di fatto quindi si parte da concetti fisici e vi si modella o comunque si cerca il miglior modello matematico per descriverli? Processo simile dunque a quello seguito da Planck per arrivare a definire la costante che ne porta il nome ? ', 2664, 'cIS7zS', 'anna1.sacchi@mail.polimi.it', 1),
