('89ef8375626011ecbab300e04c680140', 'Sarebbe interessante capire se, fra tutti i possibili approcci per giustificare l\'equazione di Schroedinger e derivarla da principi più generali, ne esista almeno uno che non postuli proprietà matematiche ad hoc per introdurre proprietà volute, come ad esempio la conservazione della normalizzazione. L\'unico che ho visto più in dettaglio è la formulazione che sfrutta il principio di corrispondenza, che però non mi sembra godere di tale proprietà (almeno per come l\'ho visto io).', 1194, 'MIfGGr', 'massimo.carpita@mail.polimi.it', 1),
('89efaa53626011ecbab300e04c680140', 'è curioso il fatto che alcune grandezze commutino/non commutino a seconda della funzione d\'onda del sistema.\nCiò non è molto sorprendente dal punto di vista matematico, ma non credo di aver mai visto utilizzare effettivamente questa proprietà per qualche motivo. Sarebbe interessante capire se abbia un\'interpretazione fisica o se in qualche caso generi conseguenze importanti, visto che proprio nell\'esempio riportato si cita parità/disparità della funzione d\'onda e visto che, in termini più generici, la simmetria/antisimmetria della funzione d\'onda giochi un ruolo importante riguardo, per esempio, la statistica di un sistema.', 6186, 'MIfGGr', 'massimo.carpita@mail.polimi.it', 1),
