('89f66ccf626011ecbab300e04c680140', 'Per vedere che due operatori di proiezione generalmente non commutano può \"bastare\" l\'intuizione geometrica della proiezione di un vettore in un piano cartesiano su due rette sghembe generiche passanti per il centro? O vista il contesto più particolare entro cui stiamo lavorando bisogna fare più attenzione?\nIl fatto che non commutino può essere legato intuitivamente al fatto che l\'operatore di proiezione provoca una \"perdita di informazioni\"?', 2849, 'ptB0xd', 'massimo.carpita@mail.polimi.it', 1),
