('89f72591626011ecbab300e04c680140', 'Non ho particolari commenti o domande per questo video. Avendo frequentato il corso di Metodi Matematici lo scorso semestre, anche se qui si sono presentati concetti nuovi, ho trovato abbastanza agevole comprenderli tra spiegazione nel video e dispense a disposizione. Riguardando i video a posteriori, dopo aver seguito la fine del corso Passion in Action, si ha anche più consapevolezza di dove saranno utilizzati questi strumenti permettendo di concentrarci di più su alcune parti che si è capito essere utili in seguito.', 6379, 'iGsUpI', 'massimo.carpita@mail.polimi.it', 1),
('89f743aa626011ecbab300e04c680140', 'Prof, non ho capito se il \"trucco\" con cui si trova che uno spazio che contiene un sottospazio denso in un altro ed a sua volta è contenuto in quest\'ultimo sia un teorema o semplice logica', 6216, 'VNpT1h', 'fabio1.carletti@mail.polimi.it', 1),
('89f761cb626011ecbab300e04c680140', 'like', 270, 'nkgK8L', 'AromaticDiplodocus', 1),
('89f78e3d626011ecbab300e04c680140', 'Gli elementi dello spettro che non sono autovalori, sono semplicemente valori diversi dagli autovalori e per i quali l\'operatore risolvente non è definito, o hanno degli \"impieghi/significati\" ulteriori?', 1851, 'rgF7fI', 'paolojoseph.baioni@mail.polimi.it', 1),
('89f7b43e626011ecbab300e04c680140', 'Come si coniuga il fatto che posizione e momento sono due operatori che rappresentano grandezze fisiche - reali con il fatto che sono uno la trasformata di Fourier dell\'altro e gli autovalori della trasformata possono essere immaginari?', 6542, 'rgF7fI', 'paolojoseph.baioni@mail.polimi.it', 1),
('89f7d4fb626011ecbab300e04c680140', 'Commento in generale queste prime lezioni di analisi: personalmente le ho trovate molto utili, anche se avevo già studiato in corsi precedenti tematiche simili. Utili perché: da un lato tipicamente nei corsi ci si concentra maggiormente sull\'analisi reale e su operatori limitati, dall\'altro perché rivedere i diversi concetti senza entrare troppo nei dettagli tecnici di ogni dimostrazione, avendo anche in mente l\'applicazione alla MQ, mi ha permesso di coglierne meglio i collegamenti, il quadro generale e l\'importanza.', 5013, 'ptB0xd', 'paolojoseph.baioni@mail.polimi.it', 1),
('89f7f5d8626011ecbab300e04c680140', 'like', 367, 'iuwOat', 'TrickyChimpanzee', 1),
('89f80ca2626011ecbab300e04c680140', 'like', 370, 'iuwOat', 'TrickyChimpanzee', 1),
