('89f84ea9626011ecbab300e04c680140', 'will check this out PZ-NS', 924, 'iuwOat', 'TrickyChimpanzee', 1),
('89f872ca626011ecbab300e04c680140', 'Molto bello questo passaggio con Var[a] = ||APsi - E[a]Psi||^2, finalmente mi è chiara la ragione tangibile del fatto che il valore misurato di un osservabile sia un\'autovalore dell\'operatore ad esso associato, e quindi anche le relative conseguenze. Purtroppo nei corsi e libri introduttivi di MQ ho sempre trovato solo giustificazioni fisico-filosofiche, e mi era così rimasto in mente finora come un assioma di origine arcana', 4394, 'zvCzc1', 'paolojoseph.baioni@mail.polimi.it', 1),
('89f893fe626011ecbab300e04c680140', 'Anche qui, finalmente capisco l\'origine della forma dell\'operatore momento. Grazie!', 4978, 'zvCzc1', 'paolojoseph.baioni@mail.polimi.it', 1),
