('89fa0f5e626011ecbab300e04c680140', 'I like step 7 and 8. The idea of asking students why this is a good answer is crucial. And I like that Jo Gakonga gives concrete examples. I also like \"a recap\", because I can systemize my knowledge about receptive skills/ JC RAF 2 ', 1, 'npQXT2', 'ArcticStonefly', 1),
