('89fab899626011ecbab300e04c680140', 'like', 208, 'frkjPi', 'ScientificAsiaticLesserFreshwaterClam', 1),
('89fad323626011ecbab300e04c680140', 'This video was useful because I got to know about issues with listening and I believe that a good teacher should know what can be difficult for students ( especially when it comes to listening)/ JC RAF 2 ', 383, 'frkjPi', 'ScientificAsiaticLesserFreshwaterClam', 1),
('89faf2ba626011ecbab300e04c680140', 'Due domande: 1) La probabilità di passaggio da uno stato (puro o combinazione lineare) ad un altro dipende da tutta la \"storia\" della particella? O solo dall\'ultimo salto? 2) In altri corsi abbiamo visto come modelli dinamici con passaggi tra stati \"singoli\" siano modellizzabili come catene di Markov, sotto opportune ipotesi. C\'è un modello matematico standard che si applica anche in casi come questi, dove gli stati possibili sono dati anche da tutte le combinazioni lineari degli stati singoli?', 2818, 'qxd8ic', 'paolojoseph.baioni@mail.polimi.it', 1),
('89fb0fd1626011ecbab300e04c680140', 'Bei esempi, soprattutto nel caso dell\'idrogeno si capisce molto bene cosa possano rappresentare gli elementi dello spettro di un operatore. Colgo l\'occasione per chiederle un approfondimento: se ho ben capito, possiamo dividere lo spettro di un operatore T in: valori x t.c. il risolvente non è iniettivo, e questi sono gli autovalori, che corrispondono agli stati legati; valori x t.c. il risolvente non è suriettivo, e questi corrispondono agli stati liberi. Cambia qualcosa se questi ultimi li divido ulteriormente in valori t.c. il risolvente non è suriettivo, ma ha comunque immagine densa, e valori t.c. il risolvente non ha nemmeno immagine densa? Rappresentano entrambi stati liberi? Infine, mi aspetto fisicamente che gli stati legati siano discreti - quantizzati, e quindi che la parte di spettro costituita da autovalori sia discreta, e che gli stati liberi siano continui, e quindi che lo spettro restante se presente sia continuo. E\' effettivamente sempre così? Lo si può mostrare matema', 5325, 'qxd8ic', 'paolojoseph.baioni@mail.polimi.it', 1),
('89fb2ea1626011ecbab300e04c680140', 'Molto chiarificatore questo punto di vista \"alla probabilità condizionata\"', 6452, 'qxd8ic', 'paolojoseph.baioni@mail.polimi.it', 1),
('89fb5086626011ecbab300e04c680140', 'Prof, le vorrei segnalare che il codice da inserire su questa piattaforma per il terzo video (terza lezione) non è funzionante', 6551, 'rgF7fI', 'fabio1.carletti@mail.polimi.it', 1),
('89fb6ed2626011ecbab300e04c680140', 'Useful and interesting :) I agree with the statement that we should know the factors that affect on vocabulary development. I also like the idea of using dictionaries- especially printed- during the lesson. I also like vocabulary box (activities). / JC RAF 2 ', 862, 'VPLqD0', 'BumpyScarletIbis', 1),
('89fb893e626011ecbab300e04c680140', 'Scusi l\'ignoranza, ma non mi è ben chiaro come mai stiamo trattando la funzione caratteristica come se fosse una costante, cioè, stiamo trattando la moltiplicazione per una funzione come nel caso delle distribuzioni dove posso tranquillamente portare dove voglio la funzione nel crochet, ma in teoria nei prodotti scalari per la definizione che conosco questo è possibile solo con scalari. Cosa sto sbagliando?', 4881, 'ptB0xd', 'fabio1.carletti@mail.polimi.it', 1),
('89fba6fd626011ecbab300e04c680140', 'Se fosse possibile vorrei un riferimento per capire meglio cosa si intende per derivata in senso debole, e per capire meglio le differenze con la derivata distribuzionale', 5327, 'zvCzc1', 'fabio1.carletti@mail.polimi.it', 1);
