('89fbc5e4626011ecbab300e04c680140', 'Nella formulazione originale di Von Neumann era tutto nello stesso \"formalismo\" di adesso o qualcosa è stato cambiato? Nel senso, le \"scoperte\" fatte dopo hanno portato a dover cambiare o aggiornare leggermente qualche assioma o ad aggiungerne qualcuno? Mi è venuta in mente questa domanda perché noi ci stiamo restringendo a casi decisamente \"banali\", considerando sistemi di più particelle spin e quant\'altro mi sembra quasi ovvio che qualcosa debba essere cambiato. (Ovviamente è una mia apparenza, mi colpisce solamente il fatto che partendo dal caso più semplice possibile non si perda comunque la possibilità di trattare tutti i casi più difficili, cioè, ho come l\'impressione che per forza di cose stiamo semplificando troppo e perciò togliendo generalità al tutto) Non credo sia una domanda molto pertinente alla lezione ma sono molto curioso dal punto di vista dell\'evoluzione storica della teoria', 5711, 'qxd8ic', 'fabio1.carletti@mail.polimi.it', 1),
