('89fe6b69626011ecbab300e04c680140', 'From this video I got to know that guided discovery is a way to present language, especially grammar.  We can divide this process into two approaches. One of them is deductive approach and it is simply about giving students a rule and then asking them to give different examples. The second one- inductive is more demanding for a teacher, because it is about giving examples by him or her and then asking students to create a rule. It is a perfect way for students, because it is more memorable, they can keep such rules in minds for years, because they came up with them. It is also an amazing way to practice speaking in a classroom. On the other hand, some students do not like such idea and they simply do not participate in this process. Another problem is that grammar is not always clear, there are many exceptions and sometimes it  requires deeper explanations. To sum up, as in the name of this process- guided discovery- it is all about guiding students by asking questions and having good ', 0, 'gUegJA', 'UsefulLynx', 1),
('89fe85e9626011ecbab300e04c680140', 'like', 2208, 'VPLqD0', 'GrandioseIndianaBat', 1),
('89fea5cf626011ecbab300e04c680140', 'First of all, the most important things in learning vocabulary are age, personality- for sociable person it might be easier, motivation, prior knowledge, or even language attitude, because some people are simply better at learning it and remembering vocabulary. What is more, teacher\'s choice when it comes to setting tasks is also crucial, because some of them may be helpful in learning process. Teacher has to ensure that learners know learning strategies and ways to develop them.  it is important to draw learners attention to words, because It can help to notice them and remember. Research shows that exposure to the language and  repeating aloud also helps retention. Jo Gakonga also gives many examples of teaching strategies. The one that I liked is for example using wooden sticks and pretending they are people, creating stories with using particular lexical sets of vocabulary. Teacher asks concept questions- back and forwards- which is crucial in memorization. What is more, teacher ca', 2210, 'VPLqD0', 'GrandioseIndianaBat', 1),
('89febe54626011ecbab300e04c680140', 'like', 328, 'xOBiip', 'Big-heartedPiranha', 1),
('89fedd2f626011ecbab300e04c680140', 'like', 330, 'xOBiip', 'Big-heartedPiranha', 1),
('89fefb9a626011ecbab300e04c680140', 'Thanks to this video I got to know that gist tasks are important, what is more, it is easier for learner to read or listen when he or she knows what is it for. Good example of such task might be simply checking prediction, so teacher should give a title and ask students to discuss in pairs or groups what the text is going to be about. Secondly, it can be simply a task where one has to choose the correct title of the text from multiple options. The good idea is to limit the time during reading or lstening. Students should not care about not understanding every single word. Instead, they should focus on quickly getting the overall idea. For creating a better atmosphere in the clasroom or confidence in students- teacher should concentrate on setting a peer check. After all, the crucial part is simply giving them clear feedback to check the understanding. AB RAF2', 0, 'xOBiip', 'Big-heartedPiranha', 1),
('89ff1a2b626011ecbab300e04c680140', 'like', 730, '4OntGT', 'HarmlessParakeet', 1),
('89ff318e626011ecbab300e04c680140', 'like', 732, '4OntGT', 'HarmlessParakeet', 1),
('89ff5387626011ecbab300e04c680140', 'From this video I got to know that in the classroom it is not about what we teach, but how we do it.  It is crucial to be enthusiastic and egaging, otherwise students will not participate actively in the classes. Some teachers are neurotic, the have a fear of silence in the classroom, so they tend to speak a lot. Sometimes it happens that they speak all the time, even about such things like \"now I have to erase the board\" which is not needed and for the beginners it is stressful that teacher talks all the time and they do not understand. It is important to avoid such commentating, speaking too much, using high register vocabulary, phrasal verbs, difficult grammatical structures. Learners need a natural model of teacher, some who uses simple vocabulary, gives brief and clear instruction, sometimes even demonstrations, for example by pointing things in the coursebook so that everybody is sure what to do.  A good idea to solve the problem is to plan what to say before the classes. It is a', 732, '4OntGT', 'HarmlessParakeet', 1),
('89ff728e626011ecbab300e04c680140', 'like', 995, 'iuwOat', 'StiffClingfish', 1),
('89ff925c626011ecbab300e04c680140', 'Thanks to this video I got to know that when it comes to controlled practice- it is all about repetition of the same structures with limited focus on a particular parts of language. Controlled practice exercises have to be engaging, creative and personalised, so that they can work well. I like the idea of setting different dates on the board with the one big question- Did you?/ Were you? Students have to ask teacher about this dates, guess the events connected with them and teacher answers only when the question is grammatically correct.  After that, they can also work in pairs and create their own set of dates and talk together about them. I was also surprised when Jo Gakonga mentioned the blog by Milada Krejewska, who is a polish teacher. I also got to know from the internet that she is an author of many English coursebooks for students from Poland. She recommends using photographs in controlled practice. The idea is to use photographs, for example of famous people and celebrities, e', 1433, 'iuwOat', 'StiffClingfish', 1),
