('8a789785626011ecbab300e04c680140', 'Now the difference between natural and directional equivalence is clearer. I think that sometimes, instead of trying to find an equivalent that already exists in the target language, we can use directional equivalence to create something new, if I understood correctly. For example, I thought of translating the Romanian \"nesimțit\", an adjective that can also be a noun, as \"shamelacker\". In my work, I need to refer to \"nesimțiți\" as people, and not use the Romanian \"nesimțit\" as an adjective. Finding the closest natural equivalent didn\'t really work out it my case.', 5, 'rMNwFL', 'oliver.tutu99@e-uvt.ro', 1),
('8a78ae31626011ecbab300e04c680140', 'like', 423, 'rMNwFL', 'cristina.anescu99@e-uvt.ro', 1),
('8a78c510626011ecbab300e04c680140', 'I find interesting the fact that Anthony Pym explains the two concepts of natural and directional equivalence and he says that the translator must rely on the ”theorization process”. \nAnother idea would be that there are strategies, like borrowing or calque translation as methods, and these fit into one of those types of equivalence. ', 399, 'rMNwFL', 'cristina.anescu99@e-uvt.ro', 1),
