('8aacd006626011ecbab300e04c680140', 'Mi se pare o metodă foarte bună aceea de a face cititori să se atașeze emoțional de personaje prin caracterizarea indirectă, sau cea făcută de alte personaje. ', 48, 'K6ldqA', 'PopularBluejay', 1),
('8aace9f3626011ecbab300e04c680140', 'Mă întreb dacă filmul e inspirat de această carte.', 74, 'K6ldqA', 'PopularBluejay', 1),
('8aad00ac626011ecbab300e04c680140', 'Îmi place că se atrage atenția asupra rasismului și misoginismuluui, violenței domestice prezente în carte. ', 86, 'K6ldqA', 'PopularBluejay', 1),
('8aad2030626011ecbab300e04c680140', 'Apreciez comparațiile făcute între marii autori români. ', 163, 'K6ldqA', 'PopularBluejay', 1),
('8aad3b22626011ecbab300e04c680140', 'Mă întreb dacă Sadoveanu a făcut referire asupra violenței în familie deoarece a avut parte de ea, ori i se părea un lucru firesc. ', 167, 'K6ldqA', 'PopularBluejay', 1),
('8aad5388626011ecbab300e04c680140', 'E admirabil faptul că, deși Nechifor era un bărbat în toată firea, Vitoria continuă să fie grijulie cu acesta. ', 402, 'K6ldqA', 'PopularBluejay', 1),
('8aad72a2626011ecbab300e04c680140', 'Femeia dă dovadă de înțelepciune, deși recunoaște că nu a fost școlită. ', 427, 'K6ldqA', 'PopularBluejay', 1),
('8aad946e626011ecbab300e04c680140', 'Iese în evidență faptul că pretutindeni femeia era ajutată, sfătuită, fără a da detalii despre motivul întrebărilor puse. ', 487, 'K6ldqA', 'PopularBluejay', 1),
('8aadb1ed626011ecbab300e04c680140', 'Un alt aspect important subliniat în carte este legătura omului cu animalul său, mai exact cu loialul său câine. ', 729, 'K6ldqA', 'PopularBluejay', 1),
('8aadcd22626011ecbab300e04c680140', 'Mă întreb de ce a fost adusă arma crimei chair la înmormântarea victimei.', 784, 'K6ldqA', 'PopularBluejay', 1),
