('8ad95b19626011ecbab300e04c680140', '1)La 160 de ani de la înfiinţarea primului teatru naţional din România în casa lui Vasile Alecsandri se deschidea muzeul teatrului.', 42, 'TCK5NI', 'SecretVelvetCrab', 1),
('8ad971ff626011ecbab300e04c680140', '2)Muzeul ,,Mihail Eminescu \" are o colecţie de peste 36 de mii de piese.', 62, 'TCK5NI', 'SecretVelvetCrab', 1),
('8ad98b5d626011ecbab300e04c680140', '3)Vasile Alecsandri,Mihail Kogălniceanu şi Constantin Negruzzi au fost primii directori ai primului teatru naţional cu titulatura de teatru naţional.', 113, 'TCK5NI', 'SecretVelvetCrab', 1),
('8ad9a58e626011ecbab300e04c680140', '4)Nu existau scenografi şi regizori , actorii făceau totul(scenografie,regie,traducere).', 118, 'TCK5NI', 'SecretVelvetCrab', 1),
('8ad9bf4c626011ecbab300e04c680140', '5)Grigore Manolescu are un merit deosebit în evoluţia teatrului deoarece în secolul al 19-lea ,este singurul care îndrăzneşte să facă un turneu în afară(niciun alt teatru românesc nu plecase până atunci peste graniţă).', 165, 'TCK5NI', 'SecretVelvetCrab', 1),
('8ad9d8b0626011ecbab300e04c680140', '6)Costumul purtat de Grigore Manolescu în ,, Hamlet\" este întegral aşa cum l-a purtat  şi într-o fotografie în rol în 1884 şi  e păstrat la muzeul ,,Mihai Eminescu\".', 242, 'TCK5NI', 'SecretVelvetCrab', 1),
('8ad9f523626011ecbab300e04c680140', 'În anul 1840 se înființa la Iași primul teatru național din România, datorită eforturilor susținute ale lui Vasile Alecsandri, Mihail Kogălniceanu și Costache Negruzzi, avându-l ca director al trupei românești pe Costache Caragiali. Teatrul Național a avut, astfel, un rol important în formarea conștiinței istorice și culturale a românilor, în condițiile în care, în acea vreme nu exista un fundament al artei dramatice, nu existau școli care să cultive și să educe în acest domeniu.', 128, 'TCK5NI', 'EquatorialFlickertailSquirrel', 1),
('8ada13a3626011ecbab300e04c680140', 'La 160 de ani de la înființarea primului Muzeu al Teatrului din România, în casa lui Vasile Alecsandri de la Mircești, având 12 săli de expoziție care înfățișau istoricul teatrului românesc de la începuturi și până în contemporaneitate, la etajul muzeului ,,Mihai Eminescu” din Iași a fost găzduită colecția ,,Istoria teatrului românesc”, compusă din peste 36.000 de piese inedite. ', 59, 'TCK5NI', 'EquatorialFlickertailSquirrel', 1);
INSERT INTO `reaction` (`rid`, `type`, `at_second`, `video_code`, `user_name`, `visible`) VALUES
('8ada2da3626011ecbab300e04c680140', 'În acea vreme nu existau scenografi sau regizori, astfel că, atât redactarea, cât și punerea în scenă a unei piese de teatru era realizată de către actori. Un nume important al vremii este Matei Millo, care s-a remarcat prin interpretarea sa realistă, reacționând împotriva stilului declamator. Jocul său se caracteriza printr-un fin simț de observație, sobrietate, capacitate de nuanțare, minuțiozitate în caracterizarea variată a personajelor, umor și vervă neobosită. Cum bine știm, el a fost primul interpret, în travesti, a cucoanei Chirița. ', 151, 'TCK5NI', 'EquatorialFlickertailSquirrel', 1),
('8ada46e9626011ecbab300e04c680140', 'În secolul XIX, Grigore Manolescu este singurul care îndrăznește să realizeze un turneu în afara țării, împreună cu 30 de colegi și prieteni de la teatrele din București, Iași și Craiova, la Burgtheatre din Viena (teatrul imperial austriac), unde a avut un mare succes.', 242, 'TCK5NI', 'EquatorialFlickertailSquirrel', 1),
('8ada60bc626011ecbab300e04c680140', 'La muzeul ,,Mihai Eminescu” din Iași este expus costumul autentic de catifea neagră, lucrată manual, costum purtat de însuși actorul Grigore Manolescu în ,,Hamlet”, prin care a stabilit un prototip în tradiția teatrală românească.', 256, 'TCK5NI', 'EquatorialFlickertailSquirrel', 1),
