('8aed06a1626011ecbab300e04c680140', 'This video was very interesting, especially from the point of view of a student who does not like speaking tasks. To me, it was a good idea to show what the problem is at the beginning, because I think a lot of teachers don\'t realize that the reluctance to talk is not just laziness. Tips and actvities were also useful. In general, the lecture was clear, useful and pleasant. RAF3-MW', 3579, 'xXBqGU', 'FloweryJunebug', 1),
('8aed1ed0626011ecbab300e04c680140', 'like', 2936, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
