('8aed4f51626011ecbab300e04c680140', 'I think is very interesting that he is looking for books in other countries, because thanks to this we can see the differences in the approach to learning a foreign language from different perspectives.', 103, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aed6aba626011ecbab300e04c680140', 'He shows this page with simple sentences and pictures to show the abstract of the situation. I agree that it is better to learn from real life, but I see one plus here and it is the use of drawings.It helps in the process of remembering new things.', 162, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aed846e626011ecbab300e04c680140', 'It is clear for me that there is no only one good method for everyone, especially for people from another countries. For example each language has a different pattern of grammar so everyone will like different method that is easier for himself.', 297, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aed9dd4626011ecbab300e04c680140', 'We should use words that have a more pleasant association than \"method\" which is too prescriptive. Everything should be based on free will or arouse such an impression. I\'m not really surprised that people hearing the word \"method\" get discouraged.', 621, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aedb6da626011ecbab300e04c680140', 'In our country, there is also no time for experimenting with your own various methods and tasks. It is only possible durning a shorter topics or when we can replace the tasks in the coursebook with ours. ', 707, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aedd0a4626011ecbab300e04c680140', 'I agree that it is necessary for the learner to relate to his own experiences. In this way, the situation becomes real and automatically it becomes more valuable for the student.', 859, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aede94c626011ecbab300e04c680140', 'Interesting presentation of what was written in methodology books for teachers. The prospect of how it might once affect students. For example, a student could not talk about anything new that he did not learn in class, to avoid making mistakes. Now it is awful because fear stops development and there is no learning without mistakes. But there were also some valuable statements like basing on real situations or that learning by writing, speaking and reading is easier than by rules but personally I think that they are important too.  ', 1344, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aee020c626011ecbab300e04c680140', 'There are few statements too, which shows that old methodology books aren\'t useless and they are not just history.  The last 2 statements are true and relevant, but this which relates to being imprisoned between the pages of the book is hard to avoid. However, as teachers, we should always try to diversify the scope of education a little.\n\n', 1384, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aee1c41626011ecbab300e04c680140', 'It is really interesting that modern books are based on the same basic factors (like nature of language) as the previous ones. They are only reconfiqured. Thornbury used the surprising term \"recycling\" here. For example goals. It is the same factor but approach to it changed from accuracy to communication. ', 1498, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aee3797626011ecbab300e04c680140', 'He presented 9 diametrically opposed options but the choice of any side is up to the teacher who has different vision. He doesn\'t have to be on one side and I find it is natural. It would be hard to fit perfectly into this.', 1925, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aee5dae626011ecbab300e04c680140', 'I completely agree', 2109, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
('8aee7c82626011ecbab300e04c680140', 'I like that he focuses on gathering explanations for what we can take away from these methods in his book. These are not long and pointless descriptions of the steps we need to take, but he also show us what we can achieve with that methods.', 2220, 'D9Yaie', 'w.ostrycharczyk@op.pl', 1),
