('8aef8479626011ecbab300e04c680140', 'I found attractive that the video started by analyzing the students’ problems with speaking. I think that this is crucial for the teacher, because having this knowledge he or she can solve these problems easier and faster. I am glad that the verbal topic was also raised - teacher should nod and smile. It is important, because the teacher’s facial expressions and behavior have a great influence on the student’s confidence in speaking. I also like the idea of teaching some useful expressions, because thanks to this, students can improve their vocabulary and be more confident in speaking.  I am fond of the ideas of using vocabulary and grammar exercises, especially „Make a true statement about yourself using…”.  I have the impression that when the task is related to us (personally), then the students get more involved. I have to admit that I have never heard about chants (rapping) - it is interesting. I also find attractive the idea of variations (this can prevent boredom) and guessing ga', 3608, 'xXBqGU', 'IndolentRíOGrandeEscuerzo', 1),
