('8b03062c626011ecbab300e04c680140', 'like', 696, 'hT65VX', 'WhimsicalSnowMonkey', 1),
('8b0322ea626011ecbab300e04c680140', 'The way we perceive language learning has changed for the better. Today we have more contexts and more learner-specific commands.', 228, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b033fcb626011ecbab300e04c680140', 'This question also makes me wonder. What is the best and most understandable method of teaching children at school so that they remember and motivate them to continue learning the language. ', 322, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b035e9f626011ecbab300e04c680140', 'So, if so many methods have been created, how am I supposed to understand them all, so as to choose the most important, the best one to suit thirty students in the class?', 597, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b037cfd626011ecbab300e04c680140', 'The best exercises are those that partly refer to a student. Thanks to such exercises a student will get to know the language faster. ', 918, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b039385626011ecbab300e04c680140', 'This is not true. Some students show more language skills and others less. We cannot demand everything from a student. On the other hand, the teacher will not always give everything to the students. ', 1113, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b03aeac626011ecbab300e04c680140', 'Students will make mistakes, this is what learning a language is all about. The task of the teacher is to catch these mistakes and draw attention to them. My elementary school teacher always said that you can\'t make mistakes, that we should say everything right away without any mistakes, and because of one mistake in the speech she immediately gave a bad grade. Because of such teaching, I was afraid to speak English. ', 1181, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b03ca2a626011ecbab300e04c680140', 'I will agree on writing and reading. However, I think that listening is also very helpful. ', 1263, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b03e24b626011ecbab300e04c680140', 'I agree that exercises that motivate and encourage students are valuable. ', 1323, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b0404bd626011ecbab300e04c680140', 'A nice solution is when the teacher pulls out the most important elements from the book and uses the language not only when it is necessary to do so in a task. It is really interesting when the teacher motivates students to use the language outside the classroom. ', 1343, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b04234e626011ecbab300e04c680140', 'The teacher should direct students, show them which way to go. The teacher should be a guide, not an executioner. This is combined with CLT, it can use this idea for some communicative exercises, but certainly not for the whole lesson. ', 1355, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b0441cb626011ecbab300e04c680140', 'The teacher should give the students a rule, then introduce the rule to the tasks in an interesting way so that the students understand what it is about. ', 1617, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b045a7c626011ecbab300e04c680140', 'Learning by use it. ', 1658, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b0475f1626011ecbab300e04c680140', 'By learning about different methods, teachers can add various valuable solutions to their teaching. ', 2314, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
('8b049479626011ecbab300e04c680140', 'After watching this material, I find that one best teaching method cannot be established. Each method is different, but in fact they are all similar. Each teacher can choose their own method. However, when it comes to teaching thirty students in a classroom, the teacher has to be flexible enough. The teaching method is different when talking about teaching in a group of five. ', 2540, 'D9Yaie', 'aleksandraci90@gmail.com', 1),
