('8b1a780f626011ecbab300e04c680140', 'Aqui tive alguma dificuldade relativamente à rotação, mas, de resto, até este momento não tive qualquer tipo de dificuldade de execução ou de utilização da ferramenta, muito intuitiva e com o acompanhamento da professora tudo se torna mais fácil :)', 2698, 'VKJkdS', 'SuperficialDotterel', 1),
('8b1a9344626011ecbab300e04c680140', 'Tenho uma pequena dúvida relativamente aos eventos: É que, se formos a dar hover sobre o sítio onde fica a área clickável, ela está disponível desde o momento que começa o anúncio, mesmo não estando lá o botão. Entendo que sejam coisas completamente independentes uma da outra, contudo, e nomeadamente a título de curiosidade (e de manter o vídeo mais \"limpo\"), não é possível por o Event a funcionar de x a y tempo na timeline? Porque acredito que derrota um bocado a ideia de ter um botão específico clickável se a opção estiver sempre disponível. Fora isso, não tenho mais nenhuma dúvida, quero agradecer pela sua aula e quero também dizer que é uma ferramenta muito interessante da qual desconhecia. Obrigado e peço desculpa por não ter conseguido apresentar estas dúvidas mais cedo na aula que passou', 3866, 'VKJkdS', 'SuperficialDotterel', 1),
('8b1aad56626011ecbab300e04c680140', 'like', 118, 'VReeWz', 'olabondzio1999@op.pl', 1),
('8b1ac76f626011ecbab300e04c680140', 'I like the idea of the speaking activity which is shown in this video. It is about showing a class a random picture of different people and asking students to work in groups of three. Their task is to create together a few questions about a person in a particular picture. Then one student from each group is nominated to swap into another group. He or she takes the role of the person in the picture and the new group ask him or her their questions. I like this idea mainly because it is something new and can be interesting for students. They can share they ideas and spot many differences in questions from another groups. For that reason I think it is important that each group has the same picture. I also find this exercise fun and entertaining. It can be even used nowadays, during the pandemic period and teaching online, as a group practice in separated online rooms. AB, RAF3', 0, 'VReeWz', 'olabondzio1999@op.pl', 1),
('8b1ae5bb626011ecbab300e04c680140', 'like', 111, 'VReeWz', 'SnarlingIbadanMalimbe', 1),
