('8b33763e626011ecbab300e04c680140', 'Viziunea lui Eminescu reprezintă o consecință firească a geniului, a cunoașterii și nu a pesimismului schopenhauerian cum consideră criticii literari. O dovadă sunt chiar notițele sale cu privire la legea conservării energiei, gravitație, electricitate, mecanică, calorimetrie, teoria luminii în poezia ,,La steaua”, dar cea mai importantă este considerată a fi dilatarea timpului, teoria relativității a lui Einstein pe care se vehiculează că ar fi descoperit-o înaintea celebrului fizician al cărui nume este sinonim cu ideea de geniu.', 163, 'Zfx40V', 'KindlyInchworm', 1),
('8b3391df626011ecbab300e04c680140', ',,Matematica pură este poezia ideilor logice”.', 219, 'Zfx40V', 'KindlyInchworm', 1),
('8b33addc626011ecbab300e04c680140', 'Eminescu este un auditor al cursurilor marelui fizician austriac Ludwig Boltzmann la Viena.', 256, 'Zfx40V', 'KindlyInchworm', 1),
('8b33c935626011ecbab300e04c680140', 'Versul ,,Azi o vedem și nu e” din poezia ,,La steaua” reprezintă un adevăr astronomic, ilustrând nu teoria relativității, ci teoria luminii, având ca exemplu steaua Beetlejuice din constelația Orion despre care se crede că ar fi putut exploda deja și, fiindcă se găsește la aproximativ 500 de ani lumină, noi încă să o putem vedea pe cer. ', 453, 'Zfx40V', 'KindlyInchworm', 1),
('8b33e3d4626011ecbab300e04c680140', 'Luceafărul din poezia cu același nume a lui Eminescu ar circula cu o viteză mai mare decât viteza luminii, lucru imposibil din punct de vedere științific, de aceea nu se consideră a sta la baza teoriei relativității. Pe de altă parte, nuvela ,,Sărmanul Dionis” ilustrează foarte bine dilatarea timpului și modul în care fiecare individ percepe materia. Fără o constantă absolută a mărimii, nu putem afirma despre ceva că este mare sau mic. ', 688, 'Zfx40V', 'KindlyInchworm', 1),
