('8b36a2f1626011ecbab300e04c680140', 'Mi se pare interesant faptul ca poezia eminesciana ,,La steaua\" are legatura cu viteza finita a luminii.', 318, 'Zfx40V', 'MarvelousUnau', 1),
('8b36bd41626011ecbab300e04c680140', 'M-au impreusionat versurile:,,Viitorul un trecut e,pe care-l vad intors...\"', 933, 'Zfx40V', 'MarvelousUnau', 1),
('8b36d678626011ecbab300e04c680140', ',,Din chaos,Doamne,am aparut/Si m-as intoarce-n chaos...\"', 1343, 'Zfx40V', 'MarvelousUnau', 1),
('8b36f209626011ecbab300e04c680140', 'M-au impresionat elemente comune intre lucrarile lui Einstein si ale lui Eminescu.', 1937, 'Zfx40V', 'MarvelousUnau', 1),
('8b370ce4626011ecbab300e04c680140', 'La nivel microscopic, componenta spațio-temporală este ca o spumă cuantică, principiu pe care Eminescu îl adoptă atât în proza, cât și în lirica sa.', 824, 'Zfx40V', 'FelineArcticHare', 1),
('8b37298c626011ecbab300e04c680140', 'Nașterea din spuma cuantică - ,,Și vremea-ncearcă în zadar/ Din goluri a se naște.”', 897, 'Zfx40V', 'FelineArcticHare', 1),
('8b37454a626011ecbab300e04c680140', ',,Viitorul e un trecut pe care-l văd întors...” își are explicația științifică în faptul că pozitronii pot fi percepuți ca niște electroni ce se mișcă în sens invers.', 969, 'Zfx40V', 'FelineArcticHare', 1),
('8b376243626011ecbab300e04c680140', 'Cea mai inedită lucrare care filozofic atestă nașterea Universului, a cosmosului este ,,Scrisoarea I”.', 1130, 'Zfx40V', 'FelineArcticHare', 1),
('8b377deb626011ecbab300e04c680140', 'Conceptul de ,,creatio ex nihilo”.', 1182, 'Zfx40V', 'FelineArcticHare', 1),
('8b379e7f626011ecbab300e04c680140', 'Astfel, în poezia ,,Luceafărul” este prezent conceptul radiației de fond, care se explică astfel: după marea explozie Big Bang, particulele alergau dintr-o parte în alta, ciocnindu-se unele de altele și, pentru că erau încărcate electric, acestea emiteau multă radiație electromagnetică, adică lumină.', 1354, 'Zfx40V', 'FelineArcticHare', 1),
('8b37bc78626011ecbab300e04c680140', 'Ideea că Mihai Eminescu ar fi descoperit teoria relativității înaintea lui Albert Einstein nu este, de fapt, un adevăr. Întâmplarea face ca Eminescu să fi tradus în caietul său relația matematică a energiei cinetice pe care a dezvoltat-o chirurgul Robert Mayer, însă cu o mică eroare, și anume lipsa numitorului 2, astfel aceasta putând fi ușor confundată cu teoria relativității a lui Einstein. ', 1971, 'Zfx40V', 'FelineArcticHare', 1),
