('8b3dfb8c626011ecbab300e04c680140', 'I completely agree that teaching methods should be determined by the age of a student.', 319, 'hn2wXo', 'oletinka@wp.pl', 1),
('8b3e1279626011ecbab300e04c680140', 'In your opinion, at what age should children begin learning English?', 338, 'hn2wXo', 'oletinka@wp.pl', 1),
('8b3e2ead626011ecbab300e04c680140', 'In my view, gathering active teachers opinion was in this case a really good point. ', 422, 'hn2wXo', 'oletinka@wp.pl', 1),
