('8b3f483b626011ecbab300e04c680140', 'It has been proven that our brain is predictive (creating predictions of reality on the basis of past experiences) rather than reactive (reacting  to external stimuli). A reactive brain would be to inefficient for our needs.  ', 916, '3Lckr4', 'sylmic2@st.amu.edu.pl', 1),
