('8be4d899626011ecbab300e04c680140', 'First some context, then theory, this will help students understand the whole scheme.', 175, 'PZpaq5', 'aleksandraci90@gmail.com', 1),
('8be4efab626011ecbab300e04c680140', 'Such an assignment can relax them up and help them formulate a theory later.', 1223, 'PZpaq5', 'aleksandraci90@gmail.com', 1),
