('8be5b5be626011ecbab300e04c680140', 'This way, the method appeals more to the learner because it considers their language learning needs.', 1839, 'PZpaq5', 'aleksandraci90@gmail.com', 1),
('8be5cfd9626011ecbab300e04c680140', 'By repeating the statement, students will remember it better, linking to the audio-lingual method.', 286, 'PZpaq5', 'aleksandraci90@gmail.com', 1),
('8be5e75a626011ecbab300e04c680140', 'Through such statements, students will better remember the use of a given grammatical structure.', 469, 'PZpaq5', 'aleksandraci90@gmail.com', 1),
('8be5fdac626011ecbab300e04c680140', 'Practice makes perfect. The more practice, the better the results.', 734, 'PZpaq5', 'aleksandraci90@gmail.com', 1),
