('8c222306626011ecbab300e04c680140', 'The task itself has a very interesting form but i don\'t like the fact that students only get an answer when they ask the question completely correctly. This may discourage students from speaking English and make them feel less confident.', 820, 'iuwOat', 'w.ostrycharczyk@op.pl', 1),
('8c223d84626011ecbab300e04c680140', 'It is learning in the form of fun and students are much more engaged in such tasks. They use different structures, but they mainly focus on guessing. Additionally, they can learn new things in the field of culture and politics.', 1004, 'iuwOat', 'w.ostrycharczyk@op.pl', 1),
('8c22592b626011ecbab300e04c680140', 'Odd, colourful pictures draw the students\' attention the most. They like to make up stories about it and later they can compare them with real facts. Showing abstract pictures at the beginning of the lesson is a good idea to make students focused more', 1334, 'iuwOat', 'w.ostrycharczyk@op.pl', 1),
('8c2273b4626011ecbab300e04c680140', 'I would certainly use this type of task as a teacher. Students can show their creativity here, and they develop their communication skills by discussing ideas for their own poem in pairs. In addition, they listen ideas of their classmates with pleasure in this form and when their ideas are funny or interesting, they remember them more easily and faster.', 508, 'iuwOat', 'w.ostrycharczyk@op.pl', 1),
