('8c7087d2626011ecbab300e04c680140', 'Nu înțeleg cum lectura poate umple absolut toate golurile din perioada adolescenței, cel puțin asta se afirmă în acest clip. Consider că argumentele nu au fost corelate logic pentru că dacă le luăm individual, observăm că lectura nu e neapărat singura cale de ieșire din depresia adolescenței. Bineînțeles că este extrem de utilă, ne ajută mult, dar experimentarea lucrurilor despre care citești, relațiile interumane, discuțiile constructive ne ajută și ele, poate chiar mai mult în anumite condiții să depășim acea perioadă. Și să nu uităm de imaginile greșite pe care ni le putem face dacă doar citim (de ex. Don Quijote, Madame Bovary - percepție greșită despre lumea reală pentru că o cunoscuseră doar din cărți) și avem nevoie și să intrăm în contact cu lumea reală.', 0, 'yXgtqV', 'PrestigiousBull', 1),
