('8c7be89b626011ecbab300e04c680140', 'Mi-a plăcut mult prezentarea și ideea autoarei despre traducere în general și poezie în particular. Citind poezia în ambele limbi, primul gând ce mi-a venit a fost despre iertare, la Dumnezeu. M-am gândit, de asemenea, la lumina pe care Dumnezeu a pus-o în fiecare dintre noi și la iertarea pe care o primim dacă ne căim, indiferent de ce am fi făcut vreodată. Cuvintele „in the light” m-au dus cu gândul mai departe, la 1 Corinteni 13:12,  Căci vedem acum ca prin oglindă, în ghicitură, iar atunci, faţă către faţă; acum cunosc în parte, dar atunci voi cunoaşte pe deplin, precum am fost cunoscut şi eu... Eu cred că poetul se adresează lui însuși, lui celui preocupat de noroi, de întuneric, îngrijorat, poate, de păcatele comise. Mai cred că, după ce va plânge mult, el va zâmbi. Poezia a adus ceva în inima mea, și-a atins scopul.', 1592, 'WeTfXJ', 'SillyHapuka', 1),
