('8cda238c626011ecbab300e04c680140', 'like', 180, 'FasKpi', 'w.ostrycharczyk@op.pl', 1),
('8cda3ee6626011ecbab300e04c680140', 'I like that the video mentions that we should choose texts at the appropriate level. Sometimes teachers overstimate their students\' skills. It makes the students confused and usually it is less effective than while working with text at their level.', 180, 'FasKpi', 'w.ostrycharczyk@op.pl', 1),
('8cda5e4b626011ecbab300e04c680140', 'like', 88, 'FasKpi', 'wikkar4@st.amu.edu.pl', 1),
('8cda7534626011ecbab300e04c680140', 'like', 157, 'FasKpi', 'wikkar4@st.amu.edu.pl', 1),
('8cda9397626011ecbab300e04c680140', 'It is good to experiment and search for good ways for the learners and modify tasks for them.', 132, 'FasKpi', 'wikkar4@st.amu.edu.pl', 1),
('8cdab549626011ecbab300e04c680140', 'So it means for example real contexts, popular topics for them, their intrests?', 157, 'FasKpi', 'wikkar4@st.amu.edu.pl', 1),
('8cdacfda626011ecbab300e04c680140', 'like', 51, 'y7wmSb', 'wikkar4@st.amu.edu.pl', 1),
('8cdae77d626011ecbab300e04c680140', 'like', 93, 'y7wmSb', 'wikkar4@st.amu.edu.pl', 1),
('8cdb023e626011ecbab300e04c680140', 'like', 143, 'y7wmSb', 'wikkar4@st.amu.edu.pl', 1),
('8cdb1ce7626011ecbab300e04c680140', 'Pictures are always a good idea?', 148, 'y7wmSb', 'wikkar4@st.amu.edu.pl', 1),
('8cdb3587626011ecbab300e04c680140', 'like', 94, '7967Vc', 'wikkar4@st.amu.edu.pl', 1),
('8cdb53ec626011ecbab300e04c680140', 'like', 97, '7967Vc', 'w.ostrycharczyk@op.pl', 1),
('8cdb730e626011ecbab300e04c680140', 'I agree with it. In this way, we lose the time needed to do the exercises. We should focus on the most important words. If they have any problems with understanding the text, they will ask for the translation.', 97, '7967Vc', 'w.ostrycharczyk@op.pl', 1),
('8cdb95d1626011ecbab300e04c680140', 'like', 45, 'FoadF1', 'wikkar4@st.amu.edu.pl', 1),
('8cdbb22c626011ecbab300e04c680140', 'This is a very accurate comparison.', 75, 'FoadF1', 'w.ostrycharczyk@op.pl', 1),
('8cdbd3f2626011ecbab300e04c680140', 'The first example of tasks is more motivating and much more interesting. Students can present their creativity in this type of tasks.', 144, 'FoadF1', 'w.ostrycharczyk@op.pl', 1),
('8cdbf63f626011ecbab300e04c680140', 'like', 117, 'npQXT2', 'w.ostrycharczyk@op.pl', 1),
('8cdc1831626011ecbab300e04c680140', 'It is very important information. Using follow up questions learn to provide arguments for our answers.', 112, 'npQXT2', 'w.ostrycharczyk@op.pl', 1),
('8cdc3517626011ecbab300e04c680140', 'like', 102, 'npQXT2', 'wikkar4@st.amu.edu.pl', 1),
('8cdc5008626011ecbab300e04c680140', 'like', 186, 'npQXT2', 'wikkar4@st.amu.edu.pl', 1),
('8cdc6d83626011ecbab300e04c680140', 'so it is an opportunity for every student to talk', 109, 'npQXT2', 'wikkar4@st.amu.edu.pl', 1),
('8cdc87d5626011ecbab300e04c680140', 'like', 79, 'FasKpi', 'kolodziejdominik696@gmail.com', 1),
('8cdca36e626011ecbab300e04c680140', 'Thanks to this video, we learn there there are productive skills and receptive skills. (productive-we produce the language eg speaking and writing; receptive skills- we receive the language eg reading and listening). I really like  her comparison to baking a cake :)', 190, 'FasKpi', 'kolodziejdominik696@gmail.com', 1),
('8cdcc25f626011ecbab300e04c680140', 'like', 22, 'y7wmSb', 'kolodziejdominik696@gmail.com', 1),
('8cdce131626011ecbab300e04c680140', 'like', 140, '7967Vc', 'kolodziejdominik696@gmail.com', 1),
('8cdcfedb626011ecbab300e04c680140', 'Pre-teaching vocabulary is very important, but we should not translate all the words in the text. Learners should learn understanding meanings from the context.', 142, '7967Vc', 'kolodziejdominik696@gmail.com', 1),
('8cdd1b36626011ecbab300e04c680140', 'like', 44, 'FoadF1', 'kolodziejdominik696@gmail.com', 1),
