('8cdd53cc626011ecbab300e04c680140', 'like', 327, 'FoadF1', 'kolodziejdominik696@gmail.com', 1),
('8cdd6f50626011ecbab300e04c680140', 'Gist tasks are important- it is the first contact with the text so that reader can get to know what the text is about.', 41, 'FoadF1', 'kolodziejdominik696@gmail.com', 1),
('8cdd89ab626011ecbab300e04c680140', 'We have to plan all activities very carefully because students have to take some time to read the text or listen to the recordning and then do the exercises. ', 206, 'FoadF1', 'kolodziejdominik696@gmail.com', 1),
