('8ceeaf7d626011ecbab300e04c680140', 'Is it a good idea to play a game called \"I can see somethin...\" I think that would be great guessing game. One person describes  some object in classroom  that he/she sees and other leaners need to find it. Olaf Sobczak 2MA ', 1876, 'p11S0y', 'RealMoray', 1),
('8ceec7f6626011ecbab300e04c680140', 'It is worth doing pairwork, but we need to remember to give clear instructions and to choose partners creatively. We can ask students to pick up the name out of a hat  or stick colored post-its under their chairs. Students pair up with whoever has the same color. Olaf Sobczak 2MA', 2594, 'p11S0y', 'RealMoray', 1),
('8ceee2d6626011ecbab300e04c680140', 'General comment: I think it is really important to remember that the demands of the speaking task are well within students\' ability. In my opinion it is sometimes difficult to prepare the activity that would be \'success-oriented and has also a goal which is clearly achievable. However, I admire ideas and various activites presented by Penny Ur. I find her ideas really helpful, smart and clear. Olaf Sobczak 2MA.', 3665, 'p11S0y', 'RealMoray', 1),
