('8d447df0626011ecbab300e04c680140', 'Yes, I totally agree that shyness is really problematic. After having observed some classes in my elementary school, I can say that there are a lot of students who are really good, but they are afraid of speaking because of their shyness. ', 164, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d44a1f6626011ecbab300e04c680140', 'In fact, even if we are students, we are also afraid of making mistakes. ', 177, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d44c37a626011ecbab300e04c680140', 'What if people don\'t feel comfortable? How to create this situation? If there are 20students in one group, I would say that sometimes it is impossible to work with people who we feel comfortable with.', 249, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1);
