('8d44e597626011ecbab300e04c680140', 'I don\'t really agree. I think that students are afraid of making grammar mistakes, especially in terms of tenses.', 351, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d44fe8c626011ecbab300e04c680140', 'I agree with it. Standing in front of the whole class can be stressful. ', 500, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d451845626011ecbab300e04c680140', 'I agree, this kind of warm-up is needed ', 769, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d45359f626011ecbab300e04c680140', 'A lot of ideas how to make these exercises more communicative. It is really important that students can give their own ideas not only write the correct form of given verbs', 1411, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d454ec2626011ecbab300e04c680140', 'Not everyone is able to create these chants. Some students may don\'t want to do these exercises because of shyness. Personally, I don\'t like it.', 1572, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d45690b626011ecbab300e04c680140', 'I remember my pronunciation classes during the first year. We were supposed to learn dialogues by heart. At the beginning I found it boring but then I realised that thanks to this dialogues I know which sound is where.', 1710, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d458527626011ecbab300e04c680140', 'While games students are able to break their language barriers. They start playing without controlling that they are speaking English.', 2193, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
('8d459f00626011ecbab300e04c680140', 'I really like this video! I found many ideas that I would like to use in my future teaching career. ', 2628, 'xXBqGU', 'kolodziejdominik696@gmail.com', 1),
