('8d4d5e90626011ecbab300e04c680140', 'Boa noite, Professora, Diremos então que a investigação teórica, é com base em algo existente e a inv. empírica com base em dados novos? Sendo os dados da investigação positivista obtidos pela observação e os dados da investigação interpretativista obtidos através de amostra do que pretendemos investigar?', 0, 'PP1MaT', 'OrnateBullfrog', 1),
('8d4d7d3d626011ecbab300e04c680140', 'like', 1503, 'PP1MaT', 'DapperAsianConstableButterfly', 1),
