('8d4dcabd626011ecbab300e04c680140', 'like', 1501, 'PP1MaT', 'YearlyNarwhale', 1),
('8d4de4fc626011ecbab300e04c680140', 'Useful information for teachers of English [KK]', 308, 'JGHonA', 'CaringBushSqueaker', 1),
('8d4dfa59626011ecbab300e04c680140', 'Important information to remember', 716, 'JGHonA', 'CaringBushSqueaker', 1),
('8d4e12f9626011ecbab300e04c680140', 'Yes, it is very important for me to teach different varietes of englishes [KK]', 781, 'JGHonA', 'CaringBushSqueaker', 1),
('8d4e30a8626011ecbab300e04c680140', 'International usage of language is for me one of the most important factors while teaching [KK]', 1283, 'JGHonA', 'CaringBushSqueaker', 1),
('8d4e4b23626011ecbab300e04c680140', 'like', 101, 'JGHonA', 'PriceyNarwhale', 1),
('8d4e6952626011ecbab300e04c680140', 'like', 756, 'JGHonA', 'PriceyNarwhale', 1),
('8d4e87c6626011ecbab300e04c680140', 'like', 1024, 'JGHonA', 'PriceyNarwhale', 1),
