('8d4ebd4c626011ecbab300e04c680140', 'like', 1632, 'JGHonA', 'PriceyNarwhale', 1),
('8d4edc1d626011ecbab300e04c680140', 'I agree with that. And it works both ways. Content is produced in English in order to get more recognition and also when we want to search for information we are more likely to find it in English (or get more accurate info in English than in our native language). Which is one of the reasons people learn English in the first place. ~ KB', 230, 'JGHonA', 'PriceyNarwhale', 1),
('8d4ef6c2626011ecbab300e04c680140', 'But doesn\'t it apply to most languages in general? I\'m from Silesia and most people I know that speak Silesian are also able to speak Standart Polish whenever thay want (because normally they\'d be difficult to understand to people from other parts of Poland). So, don\'t all languages have some kind of a dialect spoken in a specific region of a country and a Standard version of the lanugage? ~ KB', 320, 'JGHonA', 'PriceyNarwhale', 1),
('8d4f125d626011ecbab300e04c680140', 'sometimes it was very confusing at public schools because while the materials (books and stuff) that were used in class were British, the teachers did not always use British accent or vocabulary (usually there was no criticisim over mixing Englishes). At times I still don\'t know right aways which vocab is British or American and I have to double check it and it\'s a bit annoying. ~ KB. ', 820, 'JGHonA', 'PriceyNarwhale', 1),
('8d4f2b51626011ecbab300e04c680140', 'but then if we eliminate local varieties and sometime in the future travel somewhere how will we understand what local people are saying? ~ KB', 888, 'JGHonA', 'PriceyNarwhale', 1),
('8d4f4515626011ecbab300e04c680140', 'but there are cultures that can be suprised by some common English expressions, f.e. in Korean people don\'t say \"bless you\" after somebody sneezes, they don\'t say anything at all. So when they learn English they are pretty suprised by existance of such saying. So I guess for cultures similar to those of English speaking countries the language is flexible but there are still those cultures that need to get aquainted with some cultural aspects of English (plus the difference in the amount of honorification used on a daily basis in those 2 languages is pretty significant)~ KB', 1146, 'JGHonA', 'PriceyNarwhale', 1),
('8d4f5f66626011ecbab300e04c680140', 'I agree. I\'ve noticed that too. I used to struggle with understanding the Scottish accent. The more Scottish accent I listen to, the more I can understand easily. A.P.', 459, 'JGHonA', 'JitteryMamba', 1),
('8d4f7c55626011ecbab300e04c680140', 'I agree. It doesn\'t matter what accent someone uses as long as they are understood. Therefore, we need diversity in teaching a language. I remember a situation of my friend who wanted to use the American pronunciation of English. His teacher prefered the British one, and every time he said something with a clearly American accent, she would correct him. For me, those corrections were pointless. A.P.', 781, 'JGHonA', 'JitteryMamba', 1),
('8d4f93d0626011ecbab300e04c680140', 'I think that\'s important. While using English online, someone may not know that some topics are more sensitive because those subjects are not delicate in this person\'s culture. We should make people aware of differences in cultures. A.P.', 1200, 'JGHonA', 'JitteryMamba', 1),
('8d4fad54626011ecbab300e04c680140', 'like', 795, 'JGHonA', 'ShamefulSteer', 1),
('8d4fc7ac626011ecbab300e04c680140', 'like', 1056, 'JGHonA', 'ShamefulSteer', 1),
('8d4fe230626011ecbab300e04c680140', 'like', 1142, 'JGHonA', 'ShamefulSteer', 1),
('8d4ffff9626011ecbab300e04c680140', 'like', 1835, 'JGHonA', 'ShamefulSteer', 1),
('8d501a46626011ecbab300e04c680140', 'I think it is interesting how the teacher\'s perspective of teaching changes as they gain more experience. - MD', 77, 'JGHonA', 'ShamefulSteer', 1),
('8d50349c626011ecbab300e04c680140', 'In my opinion the distinction between a native speaker and the a fully competent speaker is very accurate. If teachers only focus on the grammatical correctness they will not really teach the students how to comunicate via the foreign language. - MD', 576, 'JGHonA', 'ShamefulSteer', 1),
('8d504d00626011ecbab300e04c680140', 'I do not think there is a correct native model to go with and I feel like in primary and high school nobody really pays mind to pronunciation as long as the spoken word can be understood . - MD', 737, 'JGHonA', 'ShamefulSteer', 1),
('8d5064f5626011ecbab300e04c680140', 'I agree that while teaching we should focus on the general aspects of lanuage and exclude phrases or sayings that are only present in one variety. - MD', 931, 'JGHonA', 'ShamefulSteer', 1),
('8d5082c9626011ecbab300e04c680140', 'I think it would actually be nice to have some sort of official dictionary of international English! - MD', 1061, 'JGHonA', 'ShamefulSteer', 1),
('8d509ae6626011ecbab300e04c680140', 'like', 227, 'JGHonA', 'FinishedYorkshireTerrier', 1),
('8d50b4ad626011ecbab300e04c680140', 'like', 681, 'JGHonA', 'FinishedYorkshireTerrier', 1),
('8d50d2c3626011ecbab300e04c680140', 'like', 860, 'JGHonA', 'FinishedYorkshireTerrier', 1),
('8d50f073626011ecbab300e04c680140', 'like', 1139, 'JGHonA', 'FinishedYorkshireTerrier', 1),
('8d51087f626011ecbab300e04c680140', 'Checked it some time ago, it is connected with language and its role - BICS is more like everyday language (informal), takes about 1-3 years to learn, the second one CALP - abstract language, used mainly in the classroom when reading texts, it takes a lifetime to learn it and be fluent at the same time. :) Good to know that she will talk about it, it\'s super alluring. /ZN.', 443, 'JGHonA', 'Well-informedPython', 1),
('8d51243e626011ecbab300e04c680140', 'Checked it some time ago, it is connected with language and its role - BICS is more like everyday language (informal), takes about 1-3 years to learn, the second one CALP - abstract language, used mainly in the classroom when reading texts, it takes a lifetime to learn it and be fluent at the same time. :) Good to know that she will talk about it, it\'s super alluring. /ZN.', 499, 'JGHonA', 'Well-informedPython', 1),
('8d513ab1626011ecbab300e04c680140', 'Actually, this is kind of interesting when it comes to i/y writing. ', 921, 'JGHonA', 'Well-informedPython', 1),
('8d5150db626011ecbab300e04c680140', 'I\'ve been watching some old films recently and the old original subtitles were \"funny\" because of the modern different spelling. I think it is just the thing of old times to use \"y\". However, gonna know soon more about it because of the aluminum example. :) /ZN.', 924, 'JGHonA', 'Well-informedPython', 1),
('8d516aca626011ecbab300e04c680140', 'That\'s a shame but I think that many teachers nowadays don\'t teach that. /ZN ', 1641, 'JGHonA', 'Well-informedPython', 1),
('8d51838e626011ecbab300e04c680140', 'I\'ve always wondered what is considered when talking about speaking English and when can a person \"I know/can speak English\" MK', 104, 'JGHonA', 'UntriedCrane', 1),
('8d519ec3626011ecbab300e04c680140', 'I find it strange, because if a foreigner spoke Polish with an accent I would still be able to understand him. MK', 429, 'JGHonA', 'UntriedCrane', 1),
('8d51bd74626011ecbab300e04c680140', 'It always bothered me how in schools we are forced to British English and there was no choice of any other English. I know that I continued on that British path, but a few years back I was more interested in learning the American side of English and wasn\'t able to.  MK', 851, 'JGHonA', 'UntriedCrane', 1),
('8d51dafe626011ecbab300e04c680140', 'I appreciated how she admitted to her wrong claim. However, I am wondering if she was actually in the wrong and what the numbers actually look like. MK', 1522, 'JGHonA', 'UntriedCrane', 1),
('8d51f372626011ecbab300e04c680140', 'I undoubtedly agree that English is an international language. I remeber when I decided to start learning English it wasn\'t because  I wanted to speak with British people fluently, but because I wanted to be able to communicate with people all around the world. KK', 73, 'JGHonA', 'HappyAruanas', 1),
('8d520dd3626011ecbab300e04c680140', 'I agree with what she said about the aim of teaching English, that it\'s ultimate goal is  academic English, because it can\'t be learnt on the street , for learning basic conversational skills we don\'t need teachers. KK', 484, 'JGHonA', 'HappyAruanas', 1),
('8d522b64626011ecbab300e04c680140', 'I like the fact that she is focusing on competence of English. KK', 601, 'JGHonA', 'HappyAruanas', 1),
('8d5241a6626011ecbab300e04c680140', 'I find the question about which model of English should we be teaching very intriguing, because in fact there is no one, clear model of this language. English is constantly changing and evolving and we should be more aware of its diversity but still focus on its universal aspects since it is spoken by so many people. KK', 952, 'JGHonA', 'HappyAruanas', 1),
('8d525c3f626011ecbab300e04c680140', 'I like how she compared international english to a chameleon, since it really allows people to express their diffrent cultures/identities depending on who they are. KK', 1130, 'JGHonA', 'HappyAruanas', 1),
