('8d646123626011ecbab300e04c680140', 'Wow I never noticed the fact that we don\'t really use \"used to\" in questions. Quick check in Cambridge Dictionary and they say did is common but perceived as not correct. PS', 432, 'gKZVfI', 'TerribleWildebeest', 1),
('8d647f29626011ecbab300e04c680140', 'Nice comparison PS', 743, 'gKZVfI', 'TerribleWildebeest', 1),
('8d6497aa626011ecbab300e04c680140', 'All of those arguments against PPP are not very convincing to me. I think especially for earlier stages of learning PPP is very good for creating some foundations even if you want to put a garden on it later. It\'s important to separate the language into more digestible chunks and even that way later on it will create a whole. And very narrow focus is not a drawback but rather a characteristic (I would argue that it is positive in fact). PS', 1007, 'gKZVfI', 'TerribleWildebeest', 1),
('8d64b5cf626011ecbab300e04c680140', 'So it\'s bad when it is done wrong. Is that even an argument? PS', 1107, 'gKZVfI', 'TerribleWildebeest', 1),
('8d64d49b626011ecbab300e04c680140', 'People probably pick on it because it\'s old. I think it works for some situations, and if it does, do you really need to change it just because it\'s old? PS', 1186, 'gKZVfI', 'TerribleWildebeest', 1),
('8d64ed88626011ecbab300e04c680140', 'Ok so presumably if you are a teacher of a big group you will spot a very big veriaty of different mistakes in the first part, and then what? What should you focus on, what to do? PS', 1308, 'gKZVfI', 'TerribleWildebeest', 1),
('8d650d00626011ecbab300e04c680140', 'Just briefly going over everything is not going to stick in my opinion, especially on lower levels. PS', 1318, 'gKZVfI', 'TerribleWildebeest', 1),
('8d652708626011ecbab300e04c680140', 'Later on in education TTT might be nice, but for introducing basic structures it does not work. There would be lots of mistakes by the students at early stages of education. PS', 1525, 'gKZVfI', 'TerribleWildebeest', 1),
('8d653fb1626011ecbab300e04c680140', 'What if you have no knowledge of how to do that? PS', 1605, 'gKZVfI', 'TerribleWildebeest', 1),
('8d655694626011ecbab300e04c680140', 'Yes it is and personally I would stick to PPP and refine the technique. PS', 2028, 'gKZVfI', 'TerribleWildebeest', 1),
('8d656efa626011ecbab300e04c680140', 'like', 505, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d6586f1626011ecbab300e04c680140', 'like', 580, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d65a59b626011ecbab300e04c680140', 'like', 677, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d65c3ad626011ecbab300e04c680140', 'like', 1185, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d65e19c626011ecbab300e04c680140', 'like', 2031, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d65f9d4626011ecbab300e04c680140', 'I think this is the most common way of teachig English in schools AK', 511, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d66185e626011ecbab300e04c680140', 'this method is a really good way to introduce certain grammar structure to students', 549, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d663650626011ecbab300e04c680140', 'Context of using those structures is really important. You have to show students how they can implement this structure to their free speech.', 642, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d66510b626011ecbab300e04c680140', 'Unfortunately, teachers in schools have to strictly follow their syllabus, so very often there is no time for practicing a new structure.AK', 765, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d666c42626011ecbab300e04c680140', 'In schools teachers have only 45 minutes to introduce a grammar structure, so they have little time for every part of PPP. It would be insanely difficult to be sure that students have learned this new grammar structure and to use other structures in the same time. Maybe combining every grammar structure students have learned should be at the end of the unit? AK', 1079, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d6686fd626011ecbab300e04c680140', 'It is defenitely not perfect but I am not surprised that teachers mainly use PPP. AK', 1125, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d66a480626011ecbab300e04c680140', 'this method encourages students to participate more actively in the lesson. AK', 1440, 'gKZVfI', 'UnfoldedDuckling', 1),
('8d66bd61626011ecbab300e04c680140', 'like', 577, 'gKZVfI', 'CreativeXenotarsosaurus', 1),
('8d66dbff626011ecbab300e04c680140', 'like', 888, 'gKZVfI', 'CreativeXenotarsosaurus', 1),
('8d66fa8e626011ecbab300e04c680140', 'like', 1872, 'gKZVfI', 'CreativeXenotarsosaurus', 1),
('8d6718ab626011ecbab300e04c680140', 'like', 2070, 'gKZVfI', 'CreativeXenotarsosaurus', 1),
('8d672e9e626011ecbab300e04c680140', 'I agree that learning in context is more important and more valuable than when what we learn is in isolation. KK', 575, 'gKZVfI', 'CreativeXenotarsosaurus', 1),
('8d674901626011ecbab300e04c680140', 'In this method I like the idea that students can see by themselves that they are making a progress, which can be really motivating. KK ', 1431, 'gKZVfI', 'CreativeXenotarsosaurus', 1),
('8d6766af626011ecbab300e04c680140', 'like', 2053, 'gKZVfI', 'AdorableMule', 1),
('8d677f77626011ecbab300e04c680140', 'I agree, in fact in the past I\'ve given up lots of activities because I understood what I had to do quite quickly but I did not have enough motivation to practice and so ended up failing most of the time ~ KB', 768, 'gKZVfI', 'AdorableMule', 1),
('8d679e90626011ecbab300e04c680140', 'I don\'t think TBL would work with beginner learners of a language as (from what I understood) the learners need to have some knowledge of the language beforehand ~ KB', 1889, 'gKZVfI', 'AdorableMule', 1),
('8d67bd05626011ecbab300e04c680140', 'like', 2075, 'gKZVfI', 'SimilarMartin', 1),
('8d67db0c626011ecbab300e04c680140', 'I really like learning about new methods of teaching. Currently I\'m more familiar with BLS teaching method and traditional teaching. MK', 37, 'gKZVfI', 'SimilarMartin', 1),
('8d67f448626011ecbab300e04c680140', 'I think that learning English in such chunks isn\'t such a bad thing. Everyone needs the basics in order to learn something and it\'s a good way to start learning. MK', 946, 'gKZVfI', 'SimilarMartin', 1),
('8d680eed626011ecbab300e04c680140', 'In my opinion it would be hard to monitor a lot of students at once and correct all the mistakes. MK', 1268, 'gKZVfI', 'SimilarMartin', 1),
('8d6826d5626011ecbab300e04c680140', 'I think this is the right approach. Not focusing on one particular method, but a mixture of all of them and seeing what works best for the students and their needs. It\'s hard to do that with large groups, since everyone works differently though. But as teachers we should focus on the needs of our students and sometimes use different methods in order to get the best results in teaching language. MK', 2050, 'gKZVfI', 'SimilarMartin', 1),
('8d683e4b626011ecbab300e04c680140', 'like', 737, 'gKZVfI', 'WrongGelding', 1),
('8d685c28626011ecbab300e04c680140', 'I agree, a lot of practice is very essential to the process of learning /MC', 745, 'gKZVfI', 'WrongGelding', 1),
('8d6879d0626011ecbab300e04c680140', 'like', 425, 'gKZVfI', 'MortifiedBrownButterfly', 1),
('8d68918b626011ecbab300e04c680140', 'I find this alternative exercise really useful and even fun for the teacher / Zofia M', 1272, 'gKZVfI', 'MortifiedBrownButterfly', 1),
('8d68afde626011ecbab300e04c680140', 'I reckon this would be entertaining for the students / Zofia M', 1673, 'gKZVfI', 'MortifiedBrownButterfly', 1),
('8d68cddc626011ecbab300e04c680140', 'like', 2031, 'gKZVfI', 'AncientFlounder', 1),
('8d68eb6a626011ecbab300e04c680140', 'Interesting and accurate presentation of \"used to\" structure on a basis of an example of an old man FR', 239, 'gKZVfI', 'AncientFlounder', 1),
('8d69040e626011ecbab300e04c680140', 'I must say that I really like the idea of PPP scheme of the lesson. I really like the use of a deductive approach, which makes students active and clearly communicates the idea behind the lesson. There\'s a context provided and it both helps in understanding the topic and ensures interest of students as it refers to a daily-life situation. FR', 633, 'gKZVfI', 'AncientFlounder', 1),
('8d691e97626011ecbab300e04c680140', 'This is indeed a problem, In my school there used to be a problem when a teacher would perfom one lesson on a certain topic and then never come back to it as if 45 minutes were enough to cover the material concerning an assigned topic on a sufficient level. This obviously wasn\'t the case and is also a damaging approach to students who do not develop certain skills as easily and need extra or/and in depth explantation in order to understand the subject. FR', 950, 'gKZVfI', 'AncientFlounder', 1),
('8d69392c626011ecbab300e04c680140', 'TTT seems like a very useful too for teacher that comes in handy in assessing the strengths and weaknesses of their pupils and work according to accommodate their needs. FR', 1399, 'gKZVfI', 'AncientFlounder', 1),
('8d694fc1626011ecbab300e04c680140', 'TBL may incorporate an idea that students are important rather than just the material that needs to be covered, which shall probably prove to be a positive tool in boosting students\' feelings towards the teacher and the lessons. FR', 1886, 'gKZVfI', 'AncientFlounder', 1),
('8d696d51626011ecbab300e04c680140', 'like', 796, 'gKZVfI', 'DopeyX-RayFish', 1),
('8d6988db626011ecbab300e04c680140', 'like', 1509, 'gKZVfI', 'DopeyX-RayFish', 1),
('8d69a140626011ecbab300e04c680140', 'I don\'t think PPP is that bad. I also agree that it depends on how you do it. Sometimes it is actually good to focus on one thing, especially when it might be difficult. IK', 1131, 'gKZVfI', 'DopeyX-RayFish', 1),
('8d69c055626011ecbab300e04c680140', 'Monitoring what students are saying enables teachers to adapt to them, their knowledge and needs. Teachers can see what students already know and what should be introduced and explained. IK', 1243, 'gKZVfI', 'DopeyX-RayFish', 1),
('8d69ddab626011ecbab300e04c680140', 'Teachers clarify what needs to be clarified. There is also a lot of practice. I like it. IK', 1470, 'gKZVfI', 'DopeyX-RayFish', 1),
('8d69fb54626011ecbab300e04c680140', 'dislike', 0, 'test', 'test@test.it', 1),
('8d6a12c4626011ecbab300e04c680140', 'like', 1807, 'gKZVfI', 'AwesomeHartebeest', 1),
('8d6a2d33626011ecbab300e04c680140', 'like', 2067, 'gKZVfI', 'AwesomeHartebeest', 1),
('8d6a433d626011ecbab300e04c680140', 'I agree - it is easier for students to understand a certain construction when they are given some context. It also makes it easier for them to use it in the future. JP', 582, 'gKZVfI', 'AwesomeHartebeest', 1),
('8d6a5e31626011ecbab300e04c680140', 'That\'s a very good comparison which explains why production needs to take the greatest amount of time. JP', 746, 'gKZVfI', 'AwesomeHartebeest', 1),
('8d6a7cac626011ecbab300e04c680140', 'Unfortunately, very often students are really good at filling the gaps but at the same time have problems with building a sentence on their own. This shows that the main focus should be on production. JP', 1111, 'gKZVfI', 'AwesomeHartebeest', 1),
('8d6a9a83626011ecbab300e04c680140', 'c', 0, 'zciHq3', 'edoardo.putti@mail.polimi.it', 1),
('8d6ab2b2626011ecbab300e04c680140', 'c', 12817, 'zciHq3', 'edoardo.putti@mail.polimi.it', 1),
