('8d6c0e30626011ecbab300e04c680140', 'that\'s an interesting method to ask learners, then give them some sentences and in the end discuss grammar//JK', 226, 'gKZVfI', 'LameAsiaticLesserFreshwaterClam', 1),
('8d6c2939626011ecbab300e04c680140', 'I don\'t know why the grammar is being explained to us since we know it already//JK', 347, 'gKZVfI', 'LameAsiaticLesserFreshwaterClam', 1),
('8d6c3f9e626011ecbab300e04c680140', 'My guess would be that it\'s because language is not being learnt in context but rather in separated chunks. Meanwhile, when we use language in everyday life, we don\'t think \"what tense should I use? What was the construction? Was it the one I practised recently?\" but we just speak.// JK', 873, 'gKZVfI', 'LameAsiaticLesserFreshwaterClam', 1),
('8d6c5acb626011ecbab300e04c680140', 'This could be quite useful as we learn the best when we\'re tested on a particular piece of information, even before we\'ve learnt it//JK', 1207, 'gKZVfI', 'LameAsiaticLesserFreshwaterClam', 1),
('8d6c7925626011ecbab300e04c680140', 'I think it\'s useful for language tasks such as persuasion but might be a bit more problematic for grammar content//JK', 1738, 'gKZVfI', 'LameAsiaticLesserFreshwaterClam', 1),
('8d6c9146626011ecbab300e04c680140', 'It can be quite challenging, I suppose, and it involves more work thank just simply following the coursebook//JK', 1915, 'gKZVfI', 'LameAsiaticLesserFreshwaterClam', 1);
