('8d6dc18a626011ecbab300e04c680140', 'I think that making them aware at the beginning that they don\'t have to know the language perfectly, but they have to do tasks to get fluency and want to speak, so that in the future they will be able to use it, for example when going abroad is a great idea. Establishing rules of cooperation and treating others with respect is also very important. As a result, students will feel more confident and less judged by others. They will know that they can safely try to say something without risking being laughed at.', 754, 'xXBqGU', 'w.ostrycharczyk@op.pl', 1),
('8d6de021626011ecbab300e04c680140', 'I think it\'s a great exercise to start with. It gives them the opportunity to be creative. It can be fun to figure out what happened. The children\'s responses may be surprising, but this will only show their openness and commitment in this task.', 1375, 'xXBqGU', 'w.ostrycharczyk@op.pl', 1),
('8d6dfab2626011ecbab300e04c680140', 'This is a good way to learn lexical phrases, but more for begginers. When children say something like this several times in the future it will be easier for them to associate the given lexical phrases and use them in more demanding tasks or in speech.', 1619, 'xXBqGU', 'w.ostrycharczyk@op.pl', 1),
('8d6e136e626011ecbab300e04c680140', 'This is a good exercise for revising vocabulary. It is a form of game, and it can even be a form of competition, so children do not use their first language because they are focused to guess faster. ', 1930, 'xXBqGU', 'w.ostrycharczyk@op.pl', 1),
