('8fd12331626011ecbab300e04c680140', 'Loi legge Loi', 53, 'root', 'vM1z1Ai-OWk', '4b406f2f626011ecbab300e04c680140', 'M1fp7r', ' Franco Loi legge una sua poesia agli studenti del Liceo Casiraghi di Cinisello:\nDent la paròla vèrta mí me pèrdi,\ndeventi i ròbb del mund, l’aria che passa,\nquèla parola che sta dedré de l’aria\ne se fa ciara aj ögg che stann nel temp;\ne se mí parli sú no chi l’è a parlà,\nl’è ’l vent che parla nel mè d’un sentiment,\nché nient se fa dal nient e nel pensà\nla vûs che mí me ciama me vègn dent.', 0, ''),
('8fd13e56626011ecbab300e04c680140', 'CLIL: DC motor position and speed controller', 2201, 'root', 'dyjo_ggEtVU', '4af48c21626011ecbab300e04c680140', 'fM7caq', 'Controlling DC Motors with the L298N H Bridge and Arduino.\n\nGet more info about using the L298N at https://dbot.ws/l298nhbr\nMore projects and tutorials at https://dronebotworkshop.com\nPick the topic for my future videos - https://dbot.ws/dbnews', 0, ''),
('8fd16347626011ecbab300e04c680140', 'Stravinsky rilegge Gesualdo', 421, 'root', 'stUmTP2u3Oo', '4b406f2f626011ecbab300e04c680140', 'TXijj3', ' Il \"Monumentum pro Gesualdo di Venosa in CD annum\" di Stravinsky, che rilegge tre madrigali del principe musicista, trascrivendoli per strumenti in un\'unica composizione (1960)', 0, ''),
('8fd1c39c626011ecbab300e04c680140', 'Solving Quadratic Equations', 990, 'root', 'eF6zYNzlZKQ', '4acad767626011ecbab300e04c680140', 'bgJnho', 'This is a Khan Academy (good source) video introducing the concepts of quadratic equations and how to solve them. I know we hit on that in last weeks homework, but this will hopefully reaffirm some of those ideas, and be a good chance to practise your note-taking too!', 0, ''),
('8fd1e21e626011ecbab300e04c680140', 'Expenses by nature and by function', 170, 'root', 'xP707e4UeIM', '4ad765e6626011ecbab300e04c680140', 'MUhKTS', ' ', 0, ''),
('8fd2061f626011ecbab300e04c680140', 'Crash Course - Taking Notes', 531, 'root', 'E7CwqNHn_Ns', '4acad767626011ecbab300e04c680140', 'gWXu9L', ' This a pretty well put together video made by CrashCourse on some essential study skills which will be important for you to learn and carry through all the way to university. A good way to think about note taking and learning.', 0, ''),
